ovación en la sociedad zacatecana'),(65,20,'3.2.5 Fortalecer el sector de tecnologías de la información, industrial y de servicios, a través de certificaciones internacionales en tecnologías de información'),(66,21,'3.3.1 Estimular la inversión local en sectores estratégicos'),(67,21,'3.3.2 Estimular la inversión nacional y extranjera'),(68,21,'3.3.3 Fortalecer las instituciones y agencias de promoción de inversiones y las incubadoras de proyectos'),(69,22,'3.4.1 Fomentar la formación de habilidades laborales óptimas entre la población económicamente activa'),(70,22,'3.4.2 Vincular al sector educativo de la entidad (público y privado) con el sector productivo'),(71,22,'3.4.3 Potenciar de manera interinstitucional el talento para la creación de autoempleo'),(72,22,'3.4.4 Impulsar estrategias para la reducción del desempleo y el subempleo (subocupación)'),(73,22,'3.4.5 Aumentar la formalización de la economía, con un carácter social y distributivo'),(74,23,'3.5.1 Incrementar y conservar la conectividad intra e inter estatal'),(75,23,'3.5.2 Crear infraestructura tecnológica y productiva para el impulso industrial, comercial y de servicios'),(76,24,'3.6.1 Fortalecer y diversificar la agricultura sostenible'),(77,24,'3.6.2 Incrementar la productividad en la ganadería, silvicultura y pesca'),(78,24,'3.6.3 Impulsar alianzas estratégicas para promover la agroindustria'),(79,24,'3.6.4 Garantizar la sostenibilidad del recurso hídrico en el sector'),(80,25,'3.7.1 Ampliar el uso de la tecnología y la innovación en el sector industrial y empresarial'),(81,25,'3.7.2 Fortalecer el acceso a los esquemas de financiamiento para MIPyMES'),(82,25,'3.7.3 Fomentar la industrialización de procesos que proporcionen valor agregado a productos locales'),(83,25,'3.7.4 Fomentar el emprendimiento mediante asesoría y mecanismos de financiamiento'),(84,25,'3.7.5 Promover el encadenamiento de las MIPYMES a los sectores estratégicos'),(85,25,'3.7.6 Apertura de nuevos mercados nacionales e internaci