INSERT INTO `indicadores` VALUES (1,'Superficie Cosechada - Año Agrícola OI+PV Riego','0',2,7,'2010',5,'2017-10-11 00:00:00','Área de los terrenos de la unidad de producción que dispone de agua controlada a través de obras hidráulicas u otros medios hechos por el hombre, de la cual se obtuvo o se espera obtener cosecha de los cultivos sembrados en el ciclo primavera-verano u otoño-invierno.',3,76,12,1,'','','','','icono1.png',5,'','',1,0),(2,'Superficie Sembrada - Año Agrícola OI+PV Riego','0',2,7,'2010',5,'2017-10-11 00:00:00','Área de los terrenos de la unidad de producción que dispone de agua controlada a través de obras hidráulicas u otros medios hechos por el hombre, que en el periodo de referencia fue sembrada con cultivos anuales independientemente de que la cosecha se haya realizado dentro o fuera de cualquiera de los ciclos primavera-verano u otoño-invierno y del número de veces que se hayan sembrado.',3,76,12,1,'','','','','icono2.png',5,'','',1,0),(3,'Superficie Cosechada - Año Agricola OI+PV Riego + Temporal','0',2,7,'2010',5,'2017-10-11 00:00:00','Área de los terrenos de la unidad de producción de la cual se obtuvo o se espera obtener cosecha de los cultivos sembrados en el ciclo primavera-verano u otoño-invierno.',3,76,12,1,'','','','','icono3.png',5,'','',1,0),(4,'Superficie Sembrada - Año Agricola OI+PV Riego + Temporal','0',2,7,'2010',5,'2017-10-11 00:00:00','Área de los terrenos de la unidad de producción que en el periodo de referencia fue sembrada con cultivos anuales, independientemente de que la cosecha se haya realizado dentro o fuera de cualquiera de los ciclos primavera-verano u otoño-invierno y del número de veces que se hayan sembrado.',3,76,12,1,'','','','','icono4.png',5,'','',1,0),(5,'Superficie Cosechada - Cíclicos y Perennes de Riego ','0',2,7,'2010',5,'2017-10-11 00:00:00','Área de los terrenos de la unidad de producción ocupada con árboles frutales, plantaciones o pastos cultivados que han alcanzado la etapa productiva, independient