r cada cien habitantes)','0',2,26,'2010',5,'2017-09-21 00:00:00','Es el cociente entre el crecimiento natural anual (nacimientos menos defunciones)\nde un determinado período y la población media del mismo período. Puede definirse\ntambién como la diferencia entre las tasas brutas de natalidad y de mortalidad.',3,30,4,1,'','','','','icono210.png',5,'','',1,0),(211,'Tasa de crecimiento Total (por cada cien habitantes)','0',2,26,'2010',5,'2017-09-21 00:00:00','Es el cociente entre el incremento medio anual durante un período determinado y la\npoblación media del mismo período. Como consecuencia de la variación de\nnacimientos, defunciones y movimientos migratorios. Puede definirse también como\nla suma algebraica de la tasa de crecimiento natural y la tasa de migración.',3,30,4,1,'','','','','icono211.png',5,'','',1,0),(212,'Tasa Bruta de natalidad (por cada mil habitantes)','0',2,26,'2010',5,'2017-09-21 00:00:00','Mide la frecuencia de los nacimientos ocurridos en un período en relación a la\npoblación total. Es el cociente entre el número medio anual de nacimientos\nocurridos durante un período determinado y la población media del período.',3,30,4,1,'','','','','icono212.png',5,'','',1,0),(213,'Tasa global de fecundidad','0',2,26,'2010',5,'2017-09-21 00:00:00','Número medio de hijos que espera tener o haber tenido una mujer al final de su vida reproductiva de acuerdo con las tasas de fecundidad por edad observadas en un año dado.',3,31,4,1,'','','','','icono213.png',5,'','',1,0),(214,'Carencia por acceso a la alimentación (porcentaje)','0',3,17,'2010',6,'2017-10-27 00:00:00','El indicador se construye a partir de la Escala Mexicana de Seguridad Alimentaria (EMSA) y toma en consideración los siguientes elementos: En los hogares donde sólo residen adultos, se valora si en los últimos tres meses por falta de dinero o recursos algún integrante del hogar:\n\nTuvo una alimentación basada en muy poca variedad de alimentos.\n\nDejó de desayunar, comer o cenar.\n\nComió menos de lo que piensa debía comer.\n\nSe quedó sin comida.\n\nSintió hambre pero no comió.\n\nComió una vez al día o dejó de comer todo un día.\n\nEn hogares donde viven menores de dieciocho años se considera una lista de otras seis preguntas similares a las descritas anteriormente, las cuales se aplican a este grupo de población.',3,23,3,1,'','','','','icono214.png',5,'','',1,0),(215,'Población en situación de pobreza (carencias promedio)','0',3,72,'2010',6,'2017-10-27 00:00:00','Se refiere a Carencias promedio en pobreza',3,23,4,1,'','','','','icono215.png',5,'','',1,0),(216,'Carencia por acceso a la seguridad social (porcentaje)','0',3,17,'2010',6,'2017-10-27 00:00:00','La población con carencia por acceso a la seguridad social se identifica de acuerdo con los siguientes criterios:\n1.     En cuanto a la población económicamente activa, asalariada, se considera que no tiene carencia si disfruta, por parte de su trabajo, de las prestaciones establecidas en el artículo 2° de la Ley del Seguro Social.\n2.     En el caso de la población trabajadora no asalariada o independiente se considera que tiene acceso a la seguridad social cuando dispone de servicios médicos como prestación laboral o por contratación voluntaria al régimen obligatorio del IMSS y, además, cuenta con SAR o Afore.\n3.     Para la población en general, se considera que tiene acceso cuando goce de alguna jubilación o pensión, o sea familiar de una persona dentro o fuera del hogar con acceso a la seguridad social.\n4.     En el caso de la población en edad de jubilación (sesenta y cinco años o más), se considera que tiene acceso a la seguridad social si es beneficiario de algún programa social de pensiones para adultos mayores.',3,23,4,1,'','','','','icono216.png',5,'','',1,0),(217,'Carencia por acceso a la seguridad social (miles de personas)','0',3,27,'2010',6,'2017-10-27 00:00:00','Del total de personas a nivel estatal, se estimará el número de quien, no disfruta, por parte de su trabajo, de las prestaciones establecidas en el artículo 2° de la Ley del Seguro Social, no dispone de servicios médicos por contratación voluntaria al régimen obligatorio del IMSS y/o no tiene acceso cuando goce de alguna jubilación o pensión, o sea familiar de una persona dentro o fuera del hogar con acceso a la seguridad social.',3,23,3,1,'','','','','icono217.png',5,'','',1,0),(218,'Porcentaje de población con carencia por acceso a los servicios de salud','0',3,17,'2010',6,'2017-09-15 00:00:00','Porcentaje de personas que no tienen derecho a servicio médico en institución de\nsalud pública o privada.',3,30,4,1,'','','','','icono218.png',5,'','',1,0),(219,'Acceso a los servicios de salud carencia promedio','0',1,1,'2012',5,'2017-06-22 00:00:00','Se considera que una persona se encuentra en situación de carencia por acceso a los servicios de salud cuando no cuenta con adscripción o derecho a recibir servicios médicos de alguna institución que los presta, incluyendo el Seguro Popular, las instituciones públicas de seguridad social (IMSS, Issste federal o estatal, Pemex, Ejército o Marina) o los servicios médicos privados.',1,30,6,0,'','','','',NULL,5,'','',0,0),(220,'Porcentaje de carencia por calidad y espacios de la vivienda','0',3,17,'2010',6,'2017-10-26 00:00:00','Se considera como población en situación de carencia por calidad y espacios de la vivienda a las personas que residan en viviendas que presenten, al menos, una de las siguientes características:\n1.     El material de los pisos de la vivienda es de tierra.\n2.     El material del techo de la vivienda es de lámina de cartón o desechos.\n3.     El material de los muros de la vivienda es de embarro o bajareque; de carrizo, bambú o palma; de lámina de cartón, metálica o asbesto; o material de desecho.\n4.     La razón de personas por cuarto (hacinamiento) es mayor que 2.5',3,23,4,1,'','','','','icono220.png',5,'','',0,0),(221,'Porcentaje de población con Carencia por calidad y espacios de la vivienda carencia','0',3,17,'2010',6,'2017-10-26 00:00:00','El indicador toma en consideración que la vivienda cuente con materiales de construcción y espacios con las siguientes características:\n1. Piso firme de cemento o con recubrimiento (laminado, mosaico, madera);\n2. El material de techos sea losa de concreto o viguetas con bovedilla, madera, terrado con viguería, lámina metálica, de asbesto, palma, teja, o de calidad superior;\n3. El material de muros sea tabique, ladrillo, block, piedra, concreto, madera, adobe, o de calidad superior y,\n4. Que el número de personas por cuarto —contando la cocina pero excluyendo pasillos y baños— (hacinamiento) sea menor a 2.5.\nLa vivienda se considera como no carente sólo si se satisfacen de forma simultánea los cuatro criterios anteriores.',3,23,4,1,'','','','','icono221.png',5,'','',0,0),(222,'Familias atendidas por el Programa de Inclusión Social respecto al total de familias (PROSPERA)','0',2,53,'2010',5,'2017-11-06 00:00:00','Contribuir a fortalecer el cumplimiento efectivo de los derechos sociales que potencien las capacidades de las personas en situación de pobreza, a través de acciones que amplíen sus capacidades en alimentación, salud y educación, y mejoren su acceso a otras dimensiones del bienestar.',3,23,7,1,'El valor 2017 es cifra preeliminar','','','',NULL,5,'','',1,0),(223,'Gasto federal de PROSPERA Programa de Inclusión Social','0',2,13,'2010',5,'2017-11-06 00:00:00','Asegurar una aplicación eficiente, eficaz y transparente de los recursos públicos destinados a su operación, así como contribuir a la implementación de la Cruzada contra el Hambre como eje transversal de los programas de Desarrollo Social',3,23,4,1,'El valor 2017 es cifra preeliminar','','','','icono223.png',5,'','',1,0),(224,'Población en situación de pobreza moderada (carencias promedio)','0',3,72,'2010',6,'2017-10-27 00:00:00','Se refiere a la Carencia promedio en pobreza moderada',3,23,4,1,'','','','','icono224.png',5,'','',1,0),(225,'Población en situación de pobreza ext