s incluyen todos aquellos procesos que deben realizar los empresarios tanto para poder obtener todas las licencias y permisos necesarios, como para realizar cualquier notificación, comprobación o inscripción ante las autoridades correspondientes, que se exija respecto de la empresa y sus empleados. La clasificación en la facilidad de apertura de una empresa se realiza a partir de la puntuación obtenida en la medida de distancia a la frontera. Esta puntuación es el promedio simple de las puntuaciones de distancia a la frontera de cada uno de los indicadores que la componen. La medida de la distancia a la frontera muestra la distancia de una economía a la “frontera”, la cual representa la práctica más eficiente o la puntuación más alta obtenida en cada indicador',3,130,1,1,'','','','',NULL,5,'','',1,0),(505,'Cumplimiento de contratos ','0',2,69,'2014',6,'2017-10-25 00:00:00','Este indicador mide la eficiencia del cumplimiento de contratos al observar cómo evoluciona una disputa judicial por la venta de mercaderías y analizar el tiempo, costo y número de procedimientos necesarios desde que el abogado interpone la demanda hasta que se produce el pago.\n\nLa recopilación de la información que aparece en esta página forma parte del proyecto subnacional de Doing Business en México, que analiza y compara las regulaciones relacionadas con las actividades de las pequeñas y las medianas empresas locales en varias ciudades y regiones.',3,85,1,1,'','','','',NULL,5,'','Secretaría de Economía ',1,0),(506,'Intensidad energética en la economía','',3,44,'2008',6,'2017-10-25 00:00:00','Megawatts hora por millón de PIB. El PIB utilizado no considera al sector 21 Minería.\n',3,82,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(507,'Equidad Salarial','',2,17,'2008',6,'2017-10-26 00:00:00','Diferencia porcentual de los ingresos entre hombres y mujeres. Elaborado con información de ENOE, INEGI. Se toma  a las personas que trabajan 35 horas o más a la semana y reportan que ingresos. El dato anual es el promedio de los valores trimestrales.\n',3,73,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(508,'Registro de una propiedad','',1,1,'2014',1,'2017-10-25 00:00:00','Este indicador se ocupa de los procedimientos, el tiempo y el costo necesarios para el registro de propiedades, de acuerdo con un caso estandarizado en el que un empresario desea adquirir un terreno y un edificio que ya están registrados y libres de deudas o pleitos\n',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(509,'Apertura de una empresa','',3,1,'2014',6,'2017-10-25 00:00:00','Este indicador identifica los obstáculos burocráticos y legales que debe superar un emprendedor para constituir e inscribir una nueva empresa. Examina los procedimientos, tiempo y costo implicados en la creación de una sociedad comercial o industrial de hasta 50 empleados, con un capital inicial de 10 veces el ingreso nacional bruto (INB) de la economía en cuestión.',1,85,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(510,'Esfuerzos de mejora regulatoria','',2,28,'2008',6,'2017-10-25 00:00:00','Información compartida directamente por COFEMER. Con base en la Ley Modelo Estadual de Mejora Regulatoria, se identifican 14 herramientas que deben ser aplicadas a cada una de las Entidades Federativas que cuenten con una Ley Estatal de Mejora Regulatoria. Cada una de esas herramientas tiene el valor de uno y se suman de manera simple para obtener el valor final del Índice. Las herramientas son las siguientes: 1)Reglamento de Ley de Mejora Regulatoria 2)Mejores Prácticas Internacionales (vigencia) 3)Consejo de Mejora Regulatoria 4)Comisión (u Homólogo) Estatal de Mejora Regulatoria 5)Análisis de Impacto Regulatorio 6)Programa Anual de Mejora Regulatoria 7)Catálogo de Trámites y Servicios 8)Simplificación de Trámites 9)SARE 10)Poder Legislativo 11)Poder Judicial 12)Registro de expedientes electrónicos 13)Infracciones y sanciones 14)Simplificación Licencia de Construcción\n',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía ',1,0),(511,'Desigualdad Salarial','',1,1,'2014',5,'2017-10-26 00:00:00','Cociente entre personas que ganan menos de dos salarios mínimos y personas que ganan más de dos salarios mínimos.Valores anuales son el promedio de los valores observados en los trimestres del año correspondiente. Cálculos en Hoja1. Tabulados-->Tabulados interactivos-->Población ocupada-->Entidad federativa y Nivel de ingresos\n\n\n\n',3,130,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(512,'Terminales punto de venta ','',1,18,'2008',1,'2017-10-25 00:00:00','Terminales o puntos de venta por cada 10,000 adultos.  Cifras a diciembre de cada año. Se consideran adultos a todas la personas de 18 años o más.\n',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(513,'Disponibilidad de cajeros automáticos','',1,18,'2008',6,'2017-10-26 00:00:00','Cajeros por cada 10,000 habitantes. Cifras a diciembre de cada año.\n',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(514,'Capacitación laboral','',3,16,'2008',6,'2017-10-25 00:00:00','Posición a nivel nacional de la entidad según la población económicamente activa que ha recibido capacitación como porcentaje la población económicamente activa total. \nPara cada año se toma el valor que coincida con el año en que inicia el ciclo escolar ',3,65,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(515,'PIB per cápita','',2,24,'2008',6,'2017-10-26 00:00:00','Pesos por persona. No se considera el sector 21 Minería.',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(516,'Flujo aéreo de pasajeros','',1,26,'2008',6,'2017-10-26 00:00:00','Flujo de pasajeros aéreos por cada 1000 habitantes en la entidad.',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(517,'Crecimiento del PIB','',2,17,'2008',7,'2017-10-25 00:00:00','Promedio de la tasa de crecimiento real de los últimos 3 años',1,66,1,1,'','','','',NULL,5,'','Secretaría de Economía ',1,0),(518,'Flujo de pasajeros aéreos internacionales','',1,26,'2014',5,'2017-10-26 00:00:00','Porcentaje del total nacional de pasajeros aéreos que tomaron vuelos internacionales en el periodo de referencia ',3,66,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(519,'Complejidad económica en sectores de innovación','',3,58,'2008',6,'2017-10-26 00:00:00','Mide la posición de la entidad federativa a nivel nacional en la  complejidad del mercado de factores en materia de innovación Para construir el índice se tomó la proporción del PIB que en sectores considerados por Brookings de innovación y esta proporción se ponderó por el índice de complejidad económica normalizado.',3,64,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(520,'Investigadores','',1,2,'2014',1,'2017-10-25 00:00:00','Anexo_Capítulo_II_Rec_hum_en_ciencia_y_tecnología (pestaña II.41)',3,130,1,1,'','','','',NULL,5,'','Secretaría de Economía ',0,0),(521,'Empresas e instituciones científicas y tecnológicas','',2,28,'2008',6,'2017-10-26 00:00:00','Empresas e instituciones científicas y tecnológicas por cada 100,000  de la Población Económicamente Activa',3,80,1,1,'','','','',NULL,5,'','Secreataría de Economía',1,0),(522,'Desigualdad en ingresos laborales','',3,17,'2008',6,'2017-10-26 00:00:00','Se mide con el Coeficiente de Gini este  coeficiente es una medida de concentración del ingreso entre los individuos de una región, en un determinado periodo.',3,72,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(523,'Evolución de la certificación de los establecimientos con ISO 9001 y 14001','',1,58,'2014',6,'2017-11-06 00:00:00','Se descargó el ANEXO ISO 2011. La información se encuentra en la pestaña A.1.5.',3,130,1,1,'','','','',NULL,5,'','Secretaría de Economía',1,0),(524,'Población vulnerable por carencias sociales (carencias promedio)','',3,72,'2010',6,'2017-10-27 00:00:00','Se refiere a la vulnerabilidad por carencia promedio',3,130,1,1,'','','','',NULL,5,'','',1,0),(525,'Rezago educativo (porcentaje)','',3,17,'2010',1,'2017-10-27 00:00:00','Se considera que una persona se encuentra en situación de rezago educativo si i) tiene de tres a 15\naños y no cuenta con la educación básica obligatoria ni asiste a un centro de educación formal; ii) nació\nantes de 1982 y no cuenta con el nivel de educación obligatoria vigente en el momento en que debía\nhaberla cursado (primaria completa); o nació a partir de 1982 y no cuenta con el nivel de educación\nobligatoria (secundaria completa).3\n',1,130,1,1,'','','','',NULL,5,'','',1,0),(526,'Carencia por acceso a los servicios de salud (porcentaje)','',3,17,'2010',6,'2017-10-27 00:00:00','Se considera que una persona se encuentra en situación de carencia por acceso a los servicios de salud cuando: No cuenta con adscripción o derecho a recibir servicios médicos de alguna institución que los presta, incluyendo el Seguro Popular, las instituciones públicas de seguridad social (IMSS, ISSSTE federal o estatal, Pemex, Ejército o Marina) o los servicios médicos privados. \n',1,130,1,1,'','','','',NULL,5,'','',1,0),(527,'Rezago educativo (miles de personas)','',3,27,'2010',6,'2017-10-27 00:00:00','Se considera que una persona se encuentra en situación de rezago educativo si i) tiene de tres a 15\naños y no cuenta con la educación básica obligatoria ni asiste a un centro de educación formal; ii) nació\nantes de 1982 y no cuenta con el nivel de educación obligatoria vigente en el momento en que debía\nhaberla cursado (primaria completa); o nació a partir de 1982 y no cuenta con el nivel de educación\nobligatoria (secundaria completa).3\n',1,130,1,1,'','','','',NULL,5,'','',1,0),(528,'Carencia por acceso a los servicios de salud (miles de personas)','',3,27,'2010',6,'2017-10-27 00:00:00','se considera que una persona se encuentra en situación de carencia por acceso a los servicios de salud cuando: \n\n\nNo cuenta con adscripción o derecho a recibir servicios médicos de alguna institución que los presta, incluyendo el Seguro Popular, las instituciones públicas de seguridad social (IMSS, ISSSTE federal o estatal, Pemex, Ejército o Marina) o los servicios médicos privados. ',1,130,1,1,'','','','',NULL,5,'','',1,0),(529,'Carencia por acceso a la alimentación (miles de personas)','',3,27,'2010',6,'2017-10-27 00:00:00','El indicador se construye a partir de la Escala Mexicana de Seguridad Alimentaria (EMSA) y toma en consideración los siguientes elementos: En los hogares donde sólo residen adultos, se valora si en los últimos tres meses por falta de dinero o recursos algún integrante del hogar:\n\nTuvo una alimentación basada en muy poca variedad de alimentos.\n\nDejó de desayunar, comer o cenar.\n\nComió menos de lo que piensa debía comer.\n\nSe quedó sin comida.\n\nSintió hambre pero no comió.\n\nComió una vez al día o dejó de comer todo un día.\n\nEn hogares donde viven menores de dieciocho años se considera una lista de otras seis preguntas similares a las descritas anteriormente, las cuales se aplican a este grupo de población.',1,130,1,1,'','','','',NULL,5,'','',1,0),(530,'Población con ingreso inferior a la línea de bienestar mínimo (porcentaje)','',3,17,'2010',6,'2017-10-27 00:00:00','la línea de bienestar mínimo, que equivale al valor de la canasta alimentaria por persona ​al mes',1,130,1,1,'','','','',NULL,5,'','',1,0),(531,'Población con ingreso inferior a la línea de bienestar mínimo (miles de personas)','',3,27,'2010',6,'2017-10-27 00:00:00','la línea de bienestar mínimo, que equivale al valor de la canasta alimentaria por persona ​al mes',1,130,1,1,'','','','',NULL,5,'','',1,0),(532,'Población con ingreso inferior a la línea de bienestar (porcentaje)','',3,17,'2010',2,'2017-10-27 00:00:00','la línea de bienestar, que equivale al valor total de la canasta alimentaria y de la canasta no alimentaria por persona al mes.',1,130,1,1,'','','','',NULL,5,'','',1,0),(533,'Población con ingreso inferior a la línea de bienestar (miles de personas)','',3,27,'2010',6,'2017-10-27 00:00:00','la línea de bienestar, que equivale al valor total de la canasta alimentaria y de la canasta no alimentaria por persona al mes.',1,130,1,1,'','','','',NULL,5,'','',1,0);
