INSERT INTO `metas_ped` VALUES (1,'Lograr que el 50% de integrantes de los órganos de participación social para la definición de política pública, sean mujeres.',1,'0','81.86',1,'\"En el caso de la Secretaría de las Mujeres contamos con tres mecanismos de participación social:  1. Sistema Estatal para Prevenir, Atender, Sancionar y Erradicar la Violencia contra las Mujeres, tenemos en total: 75 integrantes, de los cuales 67 mujeres y 8 hombres,  representando el 89.33% de mujeres. 2. Sistema para la Igualdad entre Mujeres y Hombres del Estado de Zacatecas, tenemos en total 16 integrantes, de las cuales 9 mujeres y 7 hombres, representando el 56.25% de mujeres. 3. Observatorio de Participación Política de las Mujeres en el Estado de Zacatecas, tenemos en total 13 integrantes, todas mujeres, representando el 100%. El avance representa el promedio simple de los tres sistemas.\"','2017-08-04 00:00:00',NULL),(2,'Incrementar la participación ciudadana en los procesos electorales para alcanzar la media nacional.',1,'0','65.00',1,'\"Se han realizado foros con participación ciudadana, partidos y agrupaciones políticos, diálogos y debates convocados por el INE, IEEZ y ONG´S. Inicio y arranque de ENCCIVICA (Participación de Universidades Públicas y Privadas, Organismos Electorales Federales y Municipales y Presidencias Municipales)\"','2017-08-04 00:00:00',NULL),(3,'Actualizar anualmente la agenda de participación con las organizaciones de la sociedad civil.',1,'0','84.87',1,'Se cuenta registradas 489 Organizaciones, de las cuales 415 cuentan con un registro nacional, así como con la Clave Única de Inscripción (CLUNI).','2017-08-04 00:00:00',NULL),(4,'Mantener actualizado el 100% del Marco Jurídico Estatal.',1,'0','100.00',1,'La Dirección de Estudios Legislativos y Consultoría Legal ha actualizado el marco jurídico estatal, respecto de las reformas y nuevas leyes que se expiden por parte de la Legislatura Local y se promulgan por el Gobernador del Estado, actualmente se esta trabajando en el diseño de las herramientas de difusión  de dicha información que serán: sitio web oficial y sala de consulta abierta al público. ','2017-08-04 00:00:00',NULL),(5,'Compilar el Marco Jurídico Municipal del Estado.',1,'0','50.00',1,'Se ha logrado un avance del 50% a través de la celebración de convenios de colaboración con distintos municipios del Estado, para la compilación y difusión de su marco jurídico, así como, para la capacitación en materia de normatividad municipal.','2017-08-04 00:00:00',NULL),(6,'Garantizar la disponibilidad de las publicaciones en el Periódico Oficial en la misma fecha de su publicación, tanto en medios impresos como electrónicos.',1,'0','100.00',1,'El trámite de publicación del Marco Jurídico del Estado en el Periódico Oficial, así como la compilación y divulgación del Orden Jurídico Estatal en relación con el Plan Estatal de Desarrollo 2017-2021 y el Programa Operativo Anual tiene un avance de cumplimiento del 100%.','2017-08-04 00:00:00',NULL),(7,'Crear y operar el Sistema Estatal de Inversión Pública.',2,'0','40.00',1,'\"Se encuentra aprobado el Sistema Estatal de Inversión Pública (SEIP) en la nueva Ley de Planeación para el Desarrollo del Estado de Zacatecas, misma que esta en proceso de publicación.  Contamos con un grupo colegiado conformado por personal de SEFIN, SINFRA, SFP y COEPLA, que está elaborando el reglamento del Sistema. En construcción de una propuesta de instrumentos metodológicos,  para la evaluación ejecutiva de los proyectos, por parte los Integrante del Comité de Evaluación. Estamos adecuando la plataforma del Banco de Proyectos, considerando las necesidades de las dependencias que van a ingresar información a la misma.\"','2017-08-04 00:00:00',NULL),(8,'Crear el Sistema Estatal de Evaluación.',2,'0','50.00',1,'Se tiene el diseño normativo terminado (lineamientos), se publicará en en el marco de la Nueva Ley de Planeación aprobada por la Legislatura del Estado. Sin embargo, la comisión interinstitucional que formará el Consejo de Evaluación esta en funcionamiento, misma que publicó el Programa Anual de Evaluación y esta coordinando las evaluación definidas en el programa, como aquellas adicionales que con el ámbito de la competencia pudieran realizarse de conformidad a las evaluaciones a políticas publicas, programas y acciones Federales, adicionales a las establecidas en el PAE 2017, las cuales tendrán el mismo tratamiento que las actuales. Así mismo, se ha culminado el Diplomado en Evaluación de Política Pública, con una alianza de maestros investigadores de la UAZ y servidores públicos, lo que se sienta parte de las bases para el órgano evaluador.','2017-08-04 00:00:00',NULL),(9,'Instalar el Centro Estatal de Información Estadística y Geográfica.',2,'0','10.00',1,'Se encuentran en revisión los convenios de colaboración.','2017-08-04 00:00:00',NULL),(10,'Incrementar la recaudación de ingresos de fuentes locales a un 7% a través de una reforma fiscal integral y la modernización y sistematización del sistema de ingresos.',2,'0','37.30',1,'Los resultados de la reforma fiscal a partir de 2017, ya han tenido sus resultados, prueba de ello es el incremento de un 37.3 por ciento, al comparar los resultados del presente informe contra lo observado en el período anterior, no obstante de la no recaudación de los Impuestos Ecológicos.','2017-08-04 00:00:00',NULL),(11,'Implementar el Presupuesto Basado en Resultados, logrando estar en el rango de alto cumplimiento (70-100%) en el Índice General de Avance en PbR-SED en las Entidades Federativas.',2,'0','57.60',1,'Con respecto al 2016 hemos avanzado 15.3 puntos, ubicándonos en el 57.6% contra un 42.3% del 2016, adicionalmente subimos una posición, colocándonos en el lugar 25 del Ranking Nacional lo que permitió ser la quinta entidad que más avance tuvo con respecto al 2016. NOTA: para poder hacer esta comparación la SHCP valoró los resultados del 2016 con los nuevos criterios establecidos en el 2017.','2017-08-04 00:00:00',NULL),(12,'Lograr una calificación de 100% en el Índice de Información Presupuestal Estatal.',2,'0','56.00',1,'Para el Índice de Información Presupuestal Estatal 2016, en comparación con el 2015 nos mantuvimos en el 56%, debido a que principalmente en las secciones de Clasificaciones, Tabuladores / Plazas e información relativa con Deuda Pública nos proporcionan calificaciones por debajo del 20%, sin embargo; habrá que considerar que este porcentaje califica a la administración pasada. Así que observando las áreas de oportunidad, para el ejercicio presupuestal 2017, se realizaron cambios sustantivos en la presentación del paquete económico y  en la información que se transparenta a través de los portales gubernamentales, precisamente atendiendo las secciones en comento. Lo que se traducirá en 2017 en una mejor calificación. Nota: El IIPE 2017 si evaluara el actuar de la actual administración.','2017-08-04 00:00:00',NULL),(13,'Incrementar en un 55% el número de servidores públicos de la Administración Pública Estatal,  certificados en competencias laborales y digitales.',2,'0','14.00',1,'El presente indicador muestra el avance en porcentaje de nuestra meta planteada, contabilizando el periodo septiembre 2016 a agosto 2017 sobre la proyección al año 2021 la cual es de  2,219 acreditaciones, en la cual se planteó un crecimiento del 55%. Se realizaron un total de 303 certificaciones de las cuales 204 son  laborales mediante la Entidad de Certificación y Evaluación de la RED CONOCER y 99 digitales, mediante el Centro Evaluador Microsoft. ','2017-08-04 00:00:00',NULL),(14,'Incrementar en un 50% el número de acreditaciones en materia de capacitación de servidores públicos de la Administración Pública Estatal.',2,'0','52.00',1,'El presente indicador muestra el comportamiento en materia de capacitación, donde buscamos al año 2021 un crecimiento del 50%, nos complace informar que a la fecha tenemos un cumplimiento del 52% de avance sobre la meta proyectada la cual es de 12,550. En el periodo que se informa septiembre 2016 - agosto 2017 obtuvimos un total de 6,516 acreditaciones.','2017-08-04 00:00:00',NULL),(15,'Alcanzar el 100% de participación y cumplimiento en el proceso de Evaluación del Desempeño de los servidores públicos de confianza.',2,'0','99.00',1,'El presente indicador es el resultado del proceso número 21 de evaluación del desempeño realizado en enero 2017, evaluando el periodo enero-junio 2017, los servidores públicos convocados fueron 1,232 obteniendo la participación del 99% de los mismos. ','2017-08-04 00:00:00',NULL),(16,'Incorporar la perspectiva de género en el 80% de los programas gubernamentales.',2,'0','16.83',1,'\"De acuerdo a un estudio que se entregó en febrero de 2017 sobre brechas de desigualdad en el estado de Zacatecas, 17 de 101 programas de gobierno cuentan con perspectiva de género. Se está trabajando la propuesta de agenda de participación política con los aportes de las y los integrantes del Observatorio.\"','2017-08-04 00:00:00',NULL),(17,'1,540 Proveedores de bienes y 1,368 prestadores de servicio zacatecanos, adjudicados a través del procedimiento de compra directa al 2021.',2,'0','12.55',1,'Proveedores y prestadores de servicio adjudicados a través del procedimiento de adjudicación directa en el periodo septiembre del 2016 a mayo del 2017.','2017-08-04 00:00:00',NULL),(18,'Transparentar el 100 % de las licitaciones públicas a través del uso de medios electrónicos y redes sociales.',3,'0','90.00',1,'\"Se tiene: • Módulo de publicación de licitaciones de obra y de adquisiciones • Canales de transmisión de licitaciones • Firma electrónica\"','2017-08-04 00:00:00',NULL),(19,'Incrementar en un 50% del catálogo de servicios electrónicos de Gobierno del Estado.',3,'0','20.00',1,'En Septiembre de 2016 se contaba en la página con un registro de 300 trámites y servicios en el catálogo en línea, actualmente se cuenta con un registro de 330 trámites y servicios en línea. Fuente: Comisión Estatal de Mejora Regulatoria. ','2017-08-04 00:00:00',NULL),(20,'Mantener la calificación de 100 en la evaluación a los portales de transparencia del Poder Ejecutivo.',4,'0','94.00',1,'Implementamos acciones de mejora al portal de transparencia, logrando encabezar el ranking de portales de transparencia estatales, en la evaluación que hiciera la revista U-GOB. Señalando que en poco más de una década de evaluación de portales de transparencia es la primera vez que Zacatecas obtiene la calificación más alta. ','2017-08-04 00:00:00',NULL),(21,'Consolidar la implementación de los principios de datos abiertos, máxima publicidad y transparencia proactiva, en el 100% de los portales de Gobierno del Estado.',4,'0','100.00',1,'Para dar cumplimento a esta meta se diseño y se puso en operación la plataforma de \"Construyendo Confianza\", donde la ciudadanía podrá monitorear y constatar los avances y la calidad de la obra pública en el Estado.','2017-08-04 00:00:00',NULL),(22,'Consolidar la implementación de un esquema de participación y colaboración ciudadana para la implementación del Gobierno Abierto.',4,'0','34.00',1,'Se lleva un 34% de avance en la elaboración del \"Proyecto para la Definición de la Política Pública de Gobierno Abierto\" que será implementado en el 2018. Contemplando mecanismos de participación ciudadana ','2017-08-04 00:00:00',NULL),(23,'Instaurar el Sistema Estatal Anticorrupción.',5,'0','71.00',1,'Se lleva un avance en la armonización normativa para la implementación del Sistema Estatal Anticorrupción, se tiene publicado el decreto donde se reforma, adiciona y derogan diversas disposiciones de la Constitución Política del Estado Libre y Soberano de Zacatecas en la materia, tales como,  la Ley Orgánica de la Administración Pública del Estado de Zacatecas, la Ley del Sistema Estatal Anticorrupción, la Ley de Fiscalización y Rendición de Cuentas del Estado de Zacatecas y Ley de Justicia Administrativa del Estado de Zacatecas. ','2017-08-04 00:00:00',NULL),(24,'Crear el Sistema Integral de Gestión Pública, que unifique los sistemas de planeación, programación, presupuestación, ejecución y evaluación del gasto público.',5,'0','60.00',1,'Actualmente se cuenta con el módulo de publicaciones del programa anual de evaluación y con los lineamientos del Sistema Estatal de Evaluación, en este ámbito se han realizado talleres con las dependencias ejecutoras del gasto federalizado, a fin de mejorar las matrices de sus programas (impartido por CONEVAL-CEPAL); También se presentó en tiempo y forma el Programa Anual de Evaluación del 2017 del estado de Zacatecas, mismo al que se esta dando cumplimiento. ','2017-08-04 00:00:00',NULL),(25,'Instalar los COPLADER en 8 regiones del Estado.',6,'0','100.00',1,'En el mes de febrero se llevó a cabo la instalación formal de los 8 Comités de Planeación para el Desarrollo Regional.','2017-08-04 00:00:00',NULL),(26,'Incorporar a más del 50% de los municipios, a la Agenda para el Desarrollo Municipal.',6,'0','66.00',1,'Para la edición 2017 de la Agenda para el Desarrollo Municipal, se inscribieron 20 municipios de los al menos 30 que deberán incorporarse.','2017-08-04 00:00:00',NULL),(27,'Celebrar 5 convenios con organismos multilaterales de la ONU para fortalecer las capacidades institucionales del Gobierno del Estado y las OSC.',7,'0','20.00',1,'\"El pasado 23 de septiembre se firmó un memorando de entendimiento entre el PNUD y el Gobierno del Estado para establecer un marco de cooperación en las áreas de: a) Igualdad, inclusión, equidad;  b) Desarrollo económico productivo, competitividad y trabajo decente; c) Sostenibilidad ambiental y economía verde; d) Gobernabilidad democrática, y e) Alineación de las Políticas Púbicas a los Objetivos de Desarrollo Sostenible 2030.\"','2017-08-04 00:00:00',NULL),(28,'Lograr al 2021 que el 100% de los programas estatales se integren con enfoque de Derechos Humanos y Equidad de Género.',8,'0','30.00',1,'Se realizó un curso de capacitación para la integración de los Programas Presupuestarios 2018 con enfoque de derechos humanos y equidad de género, donde la SEMUJER revisó 35 dependencias y 16 organismos descentralizados de educación, los cuales se comprometieron a generar un diagnostico que integre la información estadística por sexo e identificar las brechas de desigualdad.','2017-08-04 00:00:00',NULL),(29,'Implementar un Programa de Difusión Estatal en Derechos Humanos.',8,'0','20.00',1,'Se encuentra en actualización el Programa Estatal de Derechos Humanos derivado de las reformas a la LOAPEZ.','2017-08-04 00:00:00',NULL),(30,'Atender a 328,250 jóvenes en pláticas, talleres y cursos en diferentes escuelas del estado.',8,'0','13.10',1,'Este avance representa lo que corresponde a este ejercicio considerando que es una meta quinquenal.','2017-08-04 00:00:00',NULL),(31,'Actualizar anualmente la agenda de la participación política para promover la igualdad de género.',8,'0','20.00',1,'En el caso de la Secretaría de las Mujeres se trabaja a través del Observatorio de Participación Política de las Mujeres en el Estado de Zacatecas incentivando la capacitación y formación de ciudadanas.','2017-08-04 00:00:00',NULL),(32,'Incorporar al 2021, el enfoque de derechos humanos de niñas, niños y adolescentes en el 100% de los programas estatales y municipales que atienden este sector de la población.',8,'0','40.00',1,'Se encuentra instalado el Sistema Estatal, y conformados los 58 Sistemas Municipales.  Se encuentra aprobado el Programa Estatal de Protección Integral de Niñas, Niños y Adolescentes. Se encuentran aprobadas  las reformas al Código Familiar, Código Civil y Código de Procedimientos Civiles para eliminar la dispensa para que los menores de edad puedan contraer matrimonio, además del Código Familiar y Código de Procedimientos Civiles para que la Adopción sea Plena.','2017-08-04 00:00:00',NULL),(33,'Aprobar y pagar de manera puntual el 100% de las pensiones y jubilaciones que se soliciten por parte de los derechohabientes y sus familiares beneficiarios.',8,'0','100.00',1,'La totalidad de las pensiones y jubilaciones solicitadas, que cumplen con los requisitos legales, han sido pagadas de manera oportuna.','2017-08-04 00:00:00',NULL),(34,'Garantizar el derecho a la identidad de todos los zacatecanos.',8,'0','70.00',1,'Actualmente se esta trabajando en la 4ta. etapa de modernización de Registro Civil, con un 70% de avance el cual contempla  digitalizaciones, capturas, capacitaciones y equipamiento de oficialías. Para la conclusión de esta etapa se esta en espera de el recurso federal, al cual tendremos acceso a finales del mes de julio del año en curso.','2017-08-04 00:00:00',NULL),(35,'625,500 personas recibirán desayunos fríos y calientes al final del quinquenio.',9,'0','11.00',1,'Durante este periodo se apoyó 67,910 beneficiarios con desayunos fríos y calientes.','2017-08-04 00:00:00',NULL),(36,'Disminuir a 43% el porcentaje de pobreza en el Estado.',9,'0','49',1,'El dato corresponde a 2016, y podrá modificarse hasta el momento en que CONEVAL emita el siguiente informe.','2017-09-20 00:00:00',NULL),(37,'Disminuir a 4% el porcentaje de pobreza extrema en el Estado.',9,'0','129',1,'El dato corresponde a 2016, y podrá modificarse hasta el momento en que CONEVAL emita el siguiente informe.','2017-09-20 00:00:00',NULL),(38,'Entregar 1,400,000 apoyos escolares.',9,'0','17.14',1,'Se tienen programadas las primeras entregas conforme al inicio del ciclo escolar 2017 - 2018. ','2017-08-09 00:00:00',NULL),(39,'Otorgar 30 mil estímulos escolares a estudiantes de escasos recursos.',9,'0','37.1',1,'Se otorgaron 11,141 apoyos, ya que hubo una ampliación presupuestal a éste rubro.','2017-09-20 00:00:00',NULL),(40,'Cubrir el 70% de la población en pobreza extrema con carencia por acceso a la alimentación a través de la instalación de huertos familiares para el autoconsumo de las familias.',9,'0','9.7',1,'De un total de 37,070 personas  en pobreza extrema con carencia en alimentación el 70% son 24,549 personas, por lo que la meta estimada es de 6,137 viviendas, al momento se han instalado 597 huertos por parte de SEDESOL ESTATAL. ','2017-09-20 00:00:00',NULL),(41,'Construcción y equipamiento o rehabilitación de 120 comedores comunitarios.',9,'0','35.8',1,'Actualmente se han habilitado 43 comedores. A cargo de SEDESOL Estatal el aspecto físico y el equipamiento; y SEDESOL Federal y el DIF se harán cargo de los insumos para la operación ','2017-09-20 00:00:00',NULL),(42,'Construcción y adecuación de 47 centros de desarrollo humano en el estado.',9,'0','49',1,'Se esta proyectando la construcción y/o adecuación de los nuevos centros, posiblemente la construcción física será a partir del próximo año. ','2017-09-20 00:00:00',NULL),(43,'Ubicar a la entidad por encima del promedio nacional en el índice de monitoreo y evaluación según entidad federativa del CONEVAL',9,'0','57.40',1,'Según el Índice de monitoreo y evaluación por entidad federativa, 2015 el promedio nacional es de 66.9, Zacatecas ocupa el lugar 24.','2017-08-04 00:00:00',NULL),(44,'Contribuir a la economía familiar de los grupos vulnerables, mediante la capacitación de diferentes oficios a 16,950 personas durante este quinquenio.',9,'0','23.3',1,'En el primer año de esta administración, llevamos 3,955 personas capacitadas con cobertura en los 58 municipios. ','2017-09-20 00:00:00',NULL),(45,'Otorgar 15,000 créditos para proyectos productivos.',9,'0','45.6',1,'En lo que va de la administración, se han otorgado 6854 créditos entre los que se incluyen 6 mil 755 a grupos organizados y/o vulnerables. ','2017-09-20 00:00:00',NULL),(46,'Reducir las brechas de marginación de los municipios que se encuentran por debajo de la media estatal.',10,'0','10.00',1,'La meta son 24 municipios y se están atendiendo con los programadas de infraestructura social comunitaria de SEDESOL y SEDUVOT.','2017-08-04 00:00:00',NULL),(47,'Operar 58 centros de desarrollo humano.',10,'0','19.00',1,'Al inicio de la administración únicamente estaban operando 4 de manera normal, actualmente operan 11 en el estado. ','2017-08-04 00:00:00',NULL),(48,'Brindar los primeros auxilios asistenciales en salud a 268,000 personas al final del quinquenio.',11,'0','18.11',1,'En los programas de Amedif, CREE y UBRs se brinda la atención medica de primera vez.','2017-08-04 00:00:00',NULL),(49,'Incrementar el número de camas por cada mil habitantes a 0.8 lo que nos posicionaría arriba de la media nacional.',11,'0','0.61',1,'El indicador  muestra una distribución de .61 camas censables por cada  mil habitantes  en la entidad, ente indicador se incrementará  al habilitar mas camas que generen egresos en los servicios de hospitalización del estado, buscando alcanzar una razón 0.8 camas censables lo que evidenciará un avance en los aspectos de cobertura, capacidad y calidad,  lo que nos posicionará arriba de la media nacional.','2017-08-04 00:00:00',NULL),(50,'Mantener por debajo de la media nacional, la razón de mortalidad materna en la entidad.',11,'0','29.90',1,'El avance muestra la Razón de Mortalidad Materna con los datos Preliminares en este 2017, los datos al cierre 2015 es de 32.6; este será  el estándar para la evaluación del estado en cuanto al resultado de muertes maternas, se contempla que para cumplir con la meta deberemos mantenernos siempre por debajo de la media nacional, buscando disminuir año con año, aunque este es un indicador que varía anualmente.','2017-08-04 00:00:00',NULL),(51,'Disminuir los nacimientos atendidos en un año por cesárea; manteniéndose por debajo de la media nacional, este indicador que valora de manera indirecta la calidad de la atención gineco-obstétrica.',11,'0','24.65',1,'Del total de nacimientos ocurridos en la entidad, el 24.65% fueron atendidos a través de métodos quirúrgicos (cesáreas), lo que nos mantiene este año por debajo de la media nacional que es de 29.87%;  con lo que contribuimos a atender  las recomendaciones de la OMS buscando en los años siguientes mantenernos siempre debajo de la media, dando cuenta a la población del compromiso  de la institución en la entidad de elevar la calidad de la atención ginecoobstétrica, así como una mejor administración al no elevar los costos de la atención.','2017-08-04 00:00:00',NULL),(52,'Incrementar el porcentaje de vacunación en el sector logrando una cobertura del 100%.',11,'0','96.83',1,'El avance en el año muestra  un 96.83% de niños que cuentan con esquema básico completo de vacunación en el estado, la meta en la presente administración es lograr una cobertura total en el sector.','2017-08-04 00:00:00',NULL),(53,'Incrementar el porcentaje por encima de la media nacional de muestras verificadas de agua potable, buscando como mínimo un cumplimiento del 93%.',11,'0','83.00',1,'El 83% del avance en referencia a la eficiencia de cloración, es respecto al monitoreo de cloro residual libre, medido en el agua que distribuyen los diferentes sistemas de abastecimiento, la vigilancia corresponde a los Servicios de Salud de Zacatecas como autoridad sanitaria, la cloración corresponde a los sistemas de abastecimiento o las presidencias municipales.','2017-08-04 00:00:00',NULL),(54,'Certificar en cinco años a 375 policías, para alcanzar la meta de 1,000 policías certificados.',12,'0','53.33',1,'Se cuenta con un avance de 200 elementos.','2017-08-04 00:00:00',NULL),(55,'Instalación de 230 puntos de cámaras de vigilancia en el Estado.',12,'0','20.86',1,'Se cuenta con un avance de 48 cámaras instaladas.','2017-08-04 00:00:00',NULL),(56,'Instalar 58 consejos ciudadanos de seguridad pública.',12,'0','41.38',1,'Se cuenta con un avance de 24 Consejos instalados.','2017-08-04 00:00:00',NULL),(57,'Del total de denuncias registradas en los módulos de atención temprana de la PGJEZ en el año, canalizar el 80% a medios alternativos de justicia.',13,'0','61.00',1,'Del total de denuncias registradas en los módulos de atención temprana, se ha canalizado el 61% a medios alternativos de justicia, lo que ha permitido disminuir el rezago. ','2017-08-04 00:00:00',NULL),(58,'Desahogar el 70% anual los dictámenes periciales solicitados por los agentes del ministerio público.',13,'0','100.00',1,'De los dictámenes solicitados por los Agentes del Ministerio Público, se han desahogado el 100% al 31 de agosto de 2017.','2017-08-04 00:00:00',NULL),(59,'Atender a 35,000 personas con asesoría jurídica.',13,'0','24.97',1,'El Instituto de la Defensoría Pública del Estado de Zacatecas, en el periodo de septiembre de 2016 a julio de 2017, atendió a 8,741 personas, brindándoles asesoría jurídica en las diferentes materias que maneja el Instituto, penal, laboral, civil, familiar y mercantil, logrando con esto un avance de 24.97 % en el logro de la meta.','2017-08-04 00:00:00',NULL),(60,'Impulsar que el 60% de los casos presentados por mujeres se resuelvan por sentencias sustentadas en instrumentos de derechos humanos de las mujeres.',13,'0','63.00',1,'De las 1,546 mujeres atendidas en el Centro de Justicia para las Mujeres, el 63% fueron vinculados a proceso, por lo que cuentan con carpeta de investigación.','2017-08-04 00:00:00',NULL),(61,'Implementar el modelo de igualdad en el 100% de las dependencias.',14,'0','42.11',1,'\"El Modelo para la Igualdad de Género con Enfoque de Derechos Humanos se implementa en: Secretaría General de Gobierno Secretaría de Finanzas Secretaría de Administración Secretaría de la Función Pública  Secretaría de las Mujeres Coordinación Estatal de Planeación Coordinación General Jurídica ISSSTEZAC\"','2017-08-04 00:00:00',NULL),(62,'Elaborar y difundir el programa estatal para prevenir, atender, sancionar y erradicar la violencia contra las mujeres.',14,'0','50.00',1,'El Programa se presentó en el Sistema Estatal de Violencia.','2017-08-04 00:00:00',NULL),(63,'Impulsar que el 40% de los espacios de toma de decisiones sean ocupados por mujeres.',14,'0','42.11',1,'\"En Modelo para la Igualdad de Género con Enfoque de Derechos Humanos promueve que los espacios de toma de decisiones sean ocupados de manera paritaria. Secretaría General de Gobierno Secretaría de Finanzas Secretaría de Administración Secretaría de la Función Pública  Secretaría de las Mujeres Coordinación Estatal de Planeación Coordinación General Jurídica ISSSTEZAC\"','2017-08-04 00:00:00',NULL),(64,'Elaborar y operar el Programa Estatal de la Juventud.',15,'0','50.00',1,'El Programa Estatal de la Juventud está en etapa de elaboración de diagnóstico y planteamiento de estrategias que fortalezcan el actuar del INJUVENTUD. En ese sentido, la estadística disponible sobre la juventud se está depurando para presentar el programa con base en la Metodología del Marco Lógico y elaborar los árboles de problemas correctos que permitan plantear las estrategias adecuadas de correcto impacto en las problemáticas que vive la juventud zacatecana. Se anticipa que los dos ejes centrales del Programa Estatal de la Juventud serán la interinstitucionalidad y la transversalización de las acciones que el INJUVENTUD realiza.  ','2017-08-04 00:00:00',NULL),(65,'Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.',15,'0','34.30',1,'Con las convocatorias presentes y las inmediatas a lanzarse, al finalizar el mes de septiembre de 2017 la atención a jóvenes  es de 33,909 jóvenes a través de los distintos programas y acciones del INJUVENTUD. El Plan Estatal de Desarrollo 2017-2021 mandata la atención al 20% de la población para todo el quinquenio, lo cual es equivalente a 98,682 jóvenes de los 493,409 que habitan el estado, según la Encuesta Intercensal de 2015 realizada por el INEGI. Así, la meta anual de intención es de 19,736 jóvenes. Los 33,909 jóvenes representan el 171.81% de la meta anual [(33,909/19,736)*100] de la meta anual que nos mandata el PED 2017-2021. ','2017-09-29 00:00:00',NULL),(66,'Identificar y atender el 60% de las personas con discapacidad registradas en el Censo de Población y Vivienda 2010.',16,'0','68.00',1,'Al día de hoy el Instituto cuenta con un registro de 32,574 personas con discapacidad identificada y atendida con algún programa, obra o servicio, de un total registrado en el Censo de Población y Vivienda del INEGI que contempla 79,528.','2017-08-04 00:00:00',NULL),(67,'Lograr que el 50% de las páginas oficiales de Gobierno del Estado cuenten con formato accesible para personas con discapacidad.',16,'0','30.00',1,'Se encuentra en etapa de construcción el manual con los lineamientos básicos de accesibilidad para las páginas y sitios web oficiales de Gobierno del Estado. ','2017-08-04 00:00:00',NULL),(68,'Conseguir que el 30% de las instalaciones del Gobierno del Estado cuenten con intérpretes de lenguaje de seña mexicana.',16,'0','50.00',1,'Actualmente se encuentra activo un Curso de Lenguaje de Señas Mexicanas para Servidoras y Servidores Públicos en el cual participan funcionarios de 23 dependencias Estatales. ','2017-08-04 00:00:00',NULL),(69,'Lograr que el 70% de las instalaciones ocupadas por instancias de Gobierno del Estado sean completamente accesibles a personas con discapacidad.',16,'0','80.00',1,'Actualmente el total de las dependencias ubicadas en el complejo Cd. Administrativa cuentan con los elementos mínimos de accesibilidad necesarios para la atención de las Personas con Discapacidad.','2017-08-04 00:00:00',NULL),(70,'Instalar y remodelar 12 unidades básicas de rehabilitación física en el Estado.',16,'0','75.00',1,'Se tiene un avance importante ya que durante este periodo y en función del presupuesto se logro concretar las mejoras a las Unidades en 9 municipios. ','2017-08-04 00:00:00',NULL),(71,'Atender un total de 1100,000 personas con terapias físicas y rehabilitación.',16,'0','5.13',1,'En base al padrón de usuarios y pacientes se han otorgado 56,485 sesiones a personas para tratar distintos padecimientos. ','2017-08-04 00:00:00',NULL),(72,'Fortalecer la cohesión de zacatecanos migrantes en otras latitudes, incrementando un 40% los programas dirigidos a ellos.',17,'0','15.00',1,'\"Se crearon  nuevos proyectos (programas) con acciones bien definidas  para este sector, como lo es el Proyecto I, Programa Mariposa,  Módulo de Atención en la SRE, apoyo a los zacatecanos migrantes deportados y repatriados. \"','2017-08-04 00:00:00',NULL),(73,'Realizar 3 talleres anuales de difusión  de derechos humanos de los migrantes en 3 sedes de federaciones de clubes.',17,'0','0.00',1,'Aún no se han llevado a cabo los talleres, se encuentra en elaboración de logística.','2017-08-04 00:00:00',NULL),(74,'Incrementar a más del 50% la atención a los zacatecanos repatriados en los programas de migrantes.',17,'0','30.00',1,'\"Se ha incrementado un 30% la atención de zacatecanos repatriados, con  el Fondo Estatal y Federal se dará apoyo a 1,200 personas, de los alrededor de 4,000 que regresen en el 2017.\"','2017-08-04 00:00:00',NULL),(75,'Elaborar el programa estatal emergente para apoyar a migrantes repatriados y de retorno.',17,'0','60.00',1,'\"Se solicito a  las dependencias estatales y federales definieran acciones especificas para la atención de este sector vulnerable, con esto se elaboró un catalogo estratégico de programas en apoyo a ellos. Así mismo se llevaron a cabo cinco foros regionales en Estados Unidos y uno en Zacatecas, con el fin de conocer los principales conceptos, tendencias de la migración internacional así como los retos para los migrantes de retorno o repatriados a partir de la entrada en vigor de la Política exterior de Presidente de los Estados Unidos de Norteamérica.   \"','2017-08-04 00:00:00',NULL),(76,'Mejorar en 6 posiciones en el medallero general de la Olimpiada Nacional.',18,'0','-33.33',1,'Con la reducción de categorías en la Olimpiada Nacional cambia obligadamente la linea base del indicador hasta 2016. Al ubicarse el estado en el lugar 31 de la tabla general de medallas, un descenso en dos posiciones significó un avance negativo respecto a la meta quinquenal.','2017-08-04 00:00:00',NULL),(77,'Alcanzar un nivel de eficiencia de 20 puntos en la participación de los deportistas zacatecanos en los eventos deportivos oficiales.',18,'0','75.00',1,'La eficiencia de 15 puntos en la participación de deportistas zacatecanos en eventos deportivos oficiales, representa el 75% de avance con relación a la meta del quinquenio. ','2017-08-04 00:00:00',NULL),(78,'Aumentar en un 100% la cantidad de deportistas que conforman la reserva estatal del deporte.',18,'0','42.89',1,'El incremento de 163 deportistas zacatecanos que participaron en eventos deportivos oficiales sobre 380 registrados en 2016, representa un porcentaje de del 42.89% respecto a una meta que se propone incrementar 380 deportistas en la reserva estatal.','2017-08-04 00:00:00',NULL),(79,'Incrementar en un 148% el número de personas que participan de manera regular en los programas del deporte social implementados por el estado.',18,'0','19.00',1,'Habiendo atendido 17,971 personas que participan de manera regular en los programas de deporte social en lo que va de 2017, observamos un avance de la meta del 19% .','2017-08-04 00:00:00',NULL),(80,'Instalar y operar 120 centros deportivos en diversos municipios de la entidad, cumpliendo con las normas de atención y funcionamiento establecidas.',18,'0','15.00',1,'Se están operando 18 centros deportivos que significan un avance del 15% en la meta quinquenal.','2017-08-04 00:00:00',NULL),(81,'Mantener un promedio de utilización del 95% de la capacidad de las instalaciones deportivas estatales.',18,'0','78.90',1,'El avance de la meta muestra que la capacidad instalada de espacios deportivos se encuentra al 74.96% lo que arroja un avance del 78.90% en la meta establecida.','2017-08-04 00:00:00',NULL),(82,'Incrementar en un 46% la cantidad de personas que utilizan las instalaciones deportivas estatales para fines de activación física regular y práctica deportiva sistemática.',18,'0','0.92',1,'Considerando un promedio de 11,546 personas que utilizaron las instalaciones deportivas a cargo del INCUFIDEZ, y habiéndonos propuesto un incremento del 46% para llegar a 16,857 a fines del quinquenio, observamos un avance de 0.92% en el cumplimiento de la meta.','2017-08-04 00:00:00',NULL),(83,'Reducir a menos de 3% la deserción escolar primaria.',19,'0','3.31',1,'El número de niños que abandonan sus estudios en este nivel educativo se ha visto incrementado en relación con los ciclos anteriores, lo que nos esta alejando de la meta establecida. Es importante tomar medidas que reviertan la  tendencia negativa.','2017-08-04 00:00:00',NULL),(84,'Disminuir la deserción escolar secundaria al 5.3%',19,'0','6.01',1,'El comportamiento del indicador de deserción en este nivel nos hace concluir que nos estamos alejando de la meta establecida, ya que comparado con el ciclo  anterior que fue de 5.94%, observamos un aumento negativo del 0.07% .','2017-08-04 00:00:00',NULL),(85,'Disminuir el porcentaje de reprobación secundaria por debajo de la media nacional actual',19,'0','12.87',1,'Basándonos en el lugar de posicionamiento a nivel nacional, observamos que nuestro Estado tuvo un retroceso de 8 lugares,  ya que nos ubicábamos  en el lugar  21, y en este ciclo se  ocupa el   29,  lo que demanda  implementar acciones que promuevan una mayor cantidad de  estudiantes que aprueben  las materias comprendidas en los planes de estudio de este nivel educativo.','2017-08-04 00:00:00',NULL),(86,'Incrementar el grado promedio de escolaridad a 8.62 en la población escolar en edad de cursar el nivel académico.',19,'0','8.60',1,'Es satisfactorio la tendencia positiva de este indicador, ya estamos a 0.02 décimas para lograr la meta.','2017-08-04 00:00:00',NULL),(87,'Aumentar 3.2% la construcción y rehabilitación de la infraestructra educativa.',19,'0','46.60',1,'Se encuentran 132 obras en proceso de un total de 283.','2017-08-04 00:00:00',NULL),(88,'Disminuir la deserción escolar en la educación media superior al 14.46%',19,'0','14.11',1,'Se observa con satisfacción que se ha rebasado la meta  en un 0.35 %, con ello tenemos que seguir avanzado  para alcanzar mejores resultados.','2017-08-04 00:00:00',NULL),(89,'Aumentar a 58.29% la eficiencia terminal en la educación media superior.',19,'0','52.96',1,'Al realizar una comparación con el ciclo  anterior, vemos un comportamiento de retroceso de este indicador, ya que tuvo en este ciclo un 3.66 % menos, lo cual nos plantea que debemos  redoblar acciones que nos permitan revertir la tendencia negativa de la eficiencia terminal en este nivel, de tal manera que podamos lograr la meta del 58.29 % .','2017-08-04 00:00:00',NULL),(90,'Reducir el analfabetismo para alcanzar un índice de 3 puntos.',19,'0','103.40',1,'En el año 2016, el Estado tenía un índice de analfabetismo de 3.6 de acuerdo a la Estimación oficial al 31 de diciembre de 2015. \nAl 31 de diciembre de 2016 (según la última estimación), el índice de analfabetismo es de 2.9, lo que significa que para el año 2017 se ha reducido 0.7 puntos y se está cumpliendo por el momento la meta planteada. \nCerca del 40% de la población analfabeta son adultos mayores y aunque es difícil atenderlos por diversas situaciones como enfermedades, problemas con la vista, renuencia, etc., se tiene el compromiso de atender a todos, incentivando su esfuerzo, ya que mediante la Campaña de Alfabetización se les otorga un apoyo de $500 pesos. La población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como: personas que cumplen 15 años y que son analfabetas; Factores a favor como:  personas analfabetas que fallecen, adultos que se alfabetizan en el IZEA, entre otros.','2017-08-04 00:00:00',NULL),(91,'Reducir a 10.9 el índice de rezago educativo en el nivel primaria y a 14.8 en secundaria.',19,'0','79.10',1,'En el año 2016, el Estado tenía un índice del 14.9 en primaria y 18.8 en el nivel secundaria, lo anterior, de acuerdo a la Estimación oficial al 31 de diciembre de 2015.\nAl 31 de diciembre de 2016 el índice de primaria y secundaria es de 13.7 (se redujo 1.2 puntos) y 18.8 respectivamente, esta información es la vigente para el año 2017. Es necesario informar que la población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como personas que cumplen 15 años y que no tienen educación primaria o secundaria, jóvenes que desertan del sistema escolarizado, y factores a favor como es, personas en rezago educativo que fallecen, adultos que concluyen nivel en el IZEA.','2017-08-04 00:00:00',NULL),(92,'Concluir la urbanización del Parque de Ciencia y Tecnología de Zacatecas',20,'0','38.00',1,'\"La urbanización del parque de ciencia  y tecnología, será en tres etapas, de las cuales la primera etapa se encuentra concluida al 100%, para el segundo semestre del año 2017 se realizará la construcción de la primera fase de la segunda etapa de la urbanización que consta de 4.8 hectáreas, para terminar el año con un total de 9.8 hectáreas urbanizadas, además se realizó lo siguiente: • Se realizó la construcción y puesta en marcha del pórtico y caseta de entrada a las instalaciones, con una inversión de 1 millón 96 mil 145 pesos. • Se construyó la barda perimetral que divide el Paso Inferior Vehicular de la vía férrea que circunda el predio del Parque con las instalaciones de la Unidad Politécnica Interdisciplinaria de Ingenierías de Zacatecas del IPN, con una inversión de 751 mil 51 pesos. • Se realizó el equipamiento e imagen urbana del Parque de Ciencia y Tecnología con una inversión 254 mil 494 pesos. Se rehabilitan y remedian de forma sustentable y ecológica más de 2 mil metros cuadrados en el predio de la primera etapa. • Se construyó y se puso en marcha el puente de conexión entre la primera y segunda etapa de urbanización con una inversión de 2 millones 257 mil 486 pesos.\"','2017-08-04 00:00:00',NULL),(93,'Otorgar al menos 6,000 becas para la formación de recursos humanos en el ámbito científico, técnico y de innovación.',20,'0','26.00',1,'Para el Consejo Zacatecano de Ciencia, Tecnología e Innovación es de vital importancia contribuir al desarrollo de talento en el sector de la CTI, como una acción que permitirá fortalecer el desempeño académico, posibilitar la eficiencia terminal de las carreras orientadas a los sectores estratégicos de desarrollo y crear mejores condiciones  de bienestar social. En este sentido el COZCyT ha incrementado de manera importante el número de becas y apoyos económicos que otorga a estudiantes e investigadores. Este año que se informa logramos entregar un total de 1 mil 567 becas a 790 mujeres y 777 hombres, por un monto de 7 millones 652 mil pesos.','2017-08-04 00:00:00',NULL),(94,'Construir y poner en marcha un edificio de Coworking Space destinado al emprendimiento tecnológico.',20,'0','25.00',1,'El edificio Coworking Space, se realizará en cuatro etapas, donde la primera  es la construcción de tres pisos con todos los servicios básicos y se encuentra al 100% terminada, para el segundo semestre del año 2017 se realizará la construcción de la segunda etapa la cual constará de la estructura básica para su instalación. ','2017-08-04 00:00:00',NULL),(95,'Impulsar la creación de al menos 15 Centros públicos y privados de Investigación y Desarrollo Tecnológico en el Parque de Ciencia y Tecnología en Zacatecas.',20,'0','33.00',1,'\"• Dieron inicio las operaciones del Centro de Investigación en Metalurgia • Dieron inicio las operaciones del Centro de Investigación en Matemáticas, A.C. CIMAT • El Centro de Investigación y Desarrollo de Soluciones de Tecnología de la Información, Comunicaciones e Ingeniería de Software de la empresa Compulogic S.A. de C.V. se encuentra en proceso de construcción de su edificio con un avance del 50 por ciento • Con un avance del 50 por ciento se construye el Centro de Desarrollo Tecnológico y de Innovación en Telecomunicaciones y Tecnología de la Información para la Minería en el estado de Zacatecas de la empresa LASEC, Telecomunicaciones S.A.P.I de C.V. • Con una avance del 30 por ciento se construye el Centro de Simulación y Desarrollo de Tecnología en Seguridad Laboral, Minería, por sus siglas CsM-EEK, de la empresa Maya Producciones S.A. de C.V. • Con un diez por ciento de avance se construye el Laboratorio de Investigación de Perforación y Sostenimiento de Roca de la empresa Servimolina S. de R. L.  • Además se asignaron predios al Centro de Investigaciones Biomédicas del Instituto Mexicano del Seguro Social IMSS, por 2 mil 321 metros cuadrados; y al Centro Regional de Desarrollo Espacial en el estado de Zacatecas de la Agencia Espacial Mexicana por un total de 2 mil 461 metros cuadrados.\"','2017-08-04 00:00:00',NULL),(96,'Acercar la divulgación científica y tecnológica mediante jornadas de ciencia en los 58 municipios del estado, impactando a más de 200 comunidades.',20,'0','17.00',1,'Para lograr el acercamiento de la ciencia, la tecnología y la innovación realizamos jornadas de ciencia que incluyen: cursos en temas de la CTI, se otorgaron apoyos, se realizaron certámenes coloquios, diálogos, encuentros de científicos e investigadores, visitas al Centro Interactivo de Ciencias Zigzag, publicamos la revista de divulgación científica eek, realizamos observaciones astronómicas. Este año que se informa realizamos 45 jornadas de ciencia en 34 municipios y localidades del estado de Zacatecas.','2017-08-04 00:00:00',NULL),(97,'Lograr un crecimiento en Inversión Extranjera Directa de 6% anual.',21,'0','25.00',1,'Tasa de variación porcentual anual del periodo del primer trimestre de 2016 en comparación al primer trimestre de 2017. Calculo realizado con datos de la Secretaría de Economía Federal.','2017-08-04 00:00:00',NULL),(98,'Alcanzar un crecimiento del 5% acumulado en el número de empresas exportadoras.',21,'0','20.00',1,'Se alcanzó un crecimiento del 100% acumulado según el Padrón de empresas exportadoras del Servicio de Administración Tributaria de la Secretaría de Hacienda y Crédito Público- IMMEX. ','2017-08-04 00:00:00',NULL),(99,'Disminuir el número de días para abrir un negocio, de 26 a 20 días.',21,'0','100.00',1,'Actualmente el número de días para abrir un negocio en Zacatecas es de 15.5 días en promedio, según datos del informe \"Doing Business en México 2016\", realizado por el Banco Mundial','2017-08-04 00:00:00',NULL),(100,'Generar 40 mil empleos.',22,'0','15.30',1,'6,153 empleos generados observando el periodo de Septiembre de 2016 a Septiembre de 2017, cifras estimadas con base a tendencia del comportamiento del empleo formal y el cruce de proyectos de inversión para el Estado de Zacatecas, si se conserva la tendencia observada, en este sentido para el mes de diciembre de 2017, se tendría una cifra estimada preeliminar de 8,321 plazas creadas. Fuente: IMSS-STyPS, registros administrativos de la SEZAC. ','2017-08-04 00:00:00',NULL),(101,'Establecer un Sistema de Planeación, Seguimiento y Evaluación para impulsar la competitividad, la atracción de inversiones y la generación de empleos en el Estado.',22,'0','10.00',1,'Se cuenta con el proyecto y parametros, para la conformación del Sistema, en este sentido se firmó convenio de colaboración con el Instituto de Informática y Estadística del Estado de Jalisco (IIEG), para la transferencia de conocimientos y plataformas de información y con ello establecer el Sistema. Fuente: Secretaría de Economía. ','2017-08-04 00:00:00',NULL),(102,'5,700 alumnos capacitados a través del Instituto de Capacitación para el Trabajo del Estado de Zacatecas.',22,'0','35.00',1,'1,999 alumnos acreditaron satisfactoriamente los cursos contenidos en el catálogo de oferta educativa de la Secretaría de Educación Pública, impartidos por instructores del Instituto de Capacitación para el Trabajo en el Estado de Zacatecas.','2017-09-21 00:00:00',NULL),(103,'Dotar de maquinaria y equipo a 1,000 proyectos de inversión productiva.',22,'0','31.90',1,'Se han apoyado 319 proyectos de inversión de maquinaria y equipo en lo que va de la presente administración, a través del Subprograma Fomento al Autoempleo, en beneficio de 526 personas, con una inversión de 10 millones 248 mil pesos . Fuente: Registros administrativos del Servicio Nacional del Empleo. ','2017-08-04 00:00:00',NULL),(104,'Gestionar la conclusión de la carretera a 4 carriles Jalpa-Calvillo',23,'0','45.00',1,'Este proyecto se han estado asignando recursos a través del Presupuesto de Egresos de la Federación.','2017-08-04 00:00:00',NULL),(105,'Gestionar la ampliación de la carretera Jerez-Tlaltenango-Guadalajara.',23,'0','15.00',1,'Se esta realizado la gestión ante la SCT para ampliar el registro que se tiene con la Unidad de Inversiones de la SHCP, con la finalidad de que en cada Ejercicio presupuestal sea asignado recursos.','2017-08-04 00:00:00',NULL),(106,'Ampliar a 4 carriles la carretera Osiris-Cosío',23,'0','5.00',1,'Se solicitó a la SCT la entrega del activo operado por CAPUFE al GODEZAC, para una vez recibida se proceda a la gestión de un modelo de APP para su ampliación a 4 carriles.','2017-08-04 00:00:00',NULL),(107,'Modernizar la carretera Fresnillo - Valparaíso',23,'0','35.00',1,'Este proyecto se han estado asignando recursos a través del Presupuesto de Egresos de la Federación.','2017-08-04 00:00:00',NULL),(108,'Libramiento ferroviario zona metropolitana.',23,'0','15.00',1,'Se cuentan con estudios de preeinversión y el análisis costo beneficio, que a su vez esta presentado en la unidad de inversiones de la SHCP para su registro.','2017-08-04 00:00:00',NULL),(109,'Desarrollo de infraestructura de gas natural para dar servicio a Fresnillo.',23,'0','25.00',1,'Se ha realizado la gestión con las empresas desarrolladoras-proveedoras del servicio.','2017-08-04 00:00:00',NULL),(110,'Desarrollo de Infraestructura para realizar despachos de importación y exportación de mercancías en la entidad.',23,'0','5.00',1,'Se ha realizado la pre-evaluación, previa al proceso de habilitación para el  Recinto Fiscalizado Estratégico en el Parque Industrial Aeropuerto.','2017-08-04 00:00:00',NULL),(111,'Urbanizar el Parque Industrial Aeropuerto, segunda etapa.',23,'0','0.00',1,'Se encuentra en desarrollo el proyecto de factibilidad y viabilidad económica. Fuente: Registros administrativos Dirección de Infraestructura SEZAC.','2017-08-04 00:00:00',NULL),(112,'Iniciar el Parque Agroindustrial Fresnillo.',23,'0','5.00',1,'La Secretaría de Economía ha realizado el proyecto ejecutivo y de ingenierías, la Secretaría del Campo debe realizar el proyecto de viabilidad económica. Fuente: Dirección de Infraestructura. ','2017-08-04 00:00:00',NULL),(113,'Incrementar en 15% la producción de las y los productores agropecuarios para generar mayor rentabilidad.',24,'0','0.00',1,'A la fecha se registra un avance de siembra en temporal del 94% de la superficie programada, así como un 96% de la superficie bajo condiciones de riego; lo anterior y dependiendo de las condiciones en que se desarrollen los cultivos hasta la cosecha, se podrá determinar el grado de incremento que se logre en la productividad y rentabilidad de los cultivos.','2017-08-04 00:00:00',NULL),(114,'Reconvertir 200 mil hectáreas a sistemas sustentables',24,'0','33',1,'A la fecha se lleva un avance de 64,494 hectáreas: 49,359 de cebada, 8,006 de girasol y 9,129 de trigo.','2017-09-26 00:00:00',NULL),(115,'Realizar 12,350 acciones para el mejoramiento génetico de la producción pecuaria',24,'0','20',1,'Del periodo septiembre 2016 a septiembre 2017, se ha realizado la entrega en eventos ganaderos un total de 1,468  sementales bovinos, ovinos y caprinos mejorados genéticamente, así como 16 capacitaciones de buenas prácticas refrerentes a inseminación de ovino caprino, lo  que significa un avance del 20% con respecto a la meta quinquenal de 12,350.','2017-08-04 00:00:00',NULL),(116,'Mejoramiento de cobertura vegetal en 500,000 hectáreas.',24,'0','24',1,'Se lleva un avance a la fecha de 11,918 hectáreas con diversas obras de conservación de suelo y agua que con respecto a la meta quinquenal representa un avance del 24%.','2017-09-26 00:00:00',NULL),(117,'Instalar una sala de subasta ganadera.',24,'0','5',1,'En este indicador se debe considerar que se trata de una segunda etapa para la conclusión del proyecto en el que ya con anterioridad existe infraestructura física que es el soporte para la consolidación del mismo;  en el compromiso que corresponde a la actual administración, se tiene ya elaborado el proyecto ejecutivo de la etapa correspondiente, el cual se encuentra en trámite en FIRCO, por lo que se estima un avance del 5% con respecto a la meta quinquenal.','2017-09-26 00:00:00',NULL),(118,'Obtener la acreditación zoosanitaria de los municipios de Villa Hidalgo, Villa González, Villa García, Pinos, Noria de Ángeles, Pánfilo Natera.',24,'0','10.00',1,'En coordinación con las instancias sanitarias en materia pecuaria, se iniciaron los trabajos correspondientes al diagnóstico de prevalencia de  tuberculosis en el ganado con un avance del 10% en el muestreo preliminar que es determinante para definir el universo del muestreo de ganado para continuar con las etapas subsecuentes exigidas para el establecimiento del estatus sanitario; estimándose a la fecha un avance en el cumplimiento de este indicador del 10%.','2017-08-04 00:00:00',NULL),(119,'Formación de 2 Agroclúster ganaderos.',24,'0','12.00',1,'Se encuentra en trámite la constitución legal de los beneficiarios del proyecto en la figura jurídica que favorezca el cumplimiento de objetivos del proyecto; otorgandole un valor estimado del 12% a esta acción con respecto de la meta quinquenal.','2017-08-04 00:00:00',NULL),(120,'Construcción de 1 Rastro TIF.',24,'0','10',1,'En este indicador ya se cuenta con anteproyecto de ejecución, el terreno en comodato para la construcción de la obra y el oficio de ejecución por parte de la COEPLA para dar inicio a la firma de convenio con el gobierno federal; es importante señalar que es un proyecto tripartita y que depende de las aportaciones que cada una de las partes realice en su oportunidad, para este caso la aportación correspondiente al municipio presenta restricción presupuestal lo que esta retrasando su ejecución por lo que se estima un avance importante en el rubro de gestión del financiamiento y sin avance en es aspecto físico.','2017-09-26 00:00:00',NULL),(121,'Construcción de 3 Presas El Tilano, Uña de Gato y Canal de Botas Achoquén.',24,'0','15.00',1,'Para el caso de la obra de la presa El Tilano, se ha determinado realizar una relocalización debido a que el terreno propuesto resultó con fallas geológicas que imposibilitan su construcción en el sitio propuesto; para la presa Uña de Gato, se encuentra en proceso de actualización  el proyecto ejecutivo con posible ejecución de la obra en el ejercicio 2018; respecto al proyecto canal de Botas-Achoquén, la obra se encuentra en proceso de licitación. Es importante tener presente, que este indicador también corresponde a una meta quinquenal.','2017-08-04 00:00:00',NULL),(122,'Modernizar 600 equipos de bombeo.',24,'0','78',1,'De septiembre 2016 a la fecha se han modernizado 465 equipos de bombeo agrícola,  lo que representa un avance del 78%  con respecto a la meta quinquena, es importante señalar que el financiamiento para este programa se derivó de un compromiso presidencial de campaña, mismo que concluye el próximo año. Y que por tanto es posible que se disminuya el ritmo de equipamientos.','2017-08-04 00:00:00',NULL),(123,'Incrementar el 2.5% anual en el valor agregado en las MIPyMES  (del Censo 2014 al Censo a 2019) a través del encadenamiento.',25,'0','68',1,'En términos absolutos tenemos un avance anual proyectado de 52,296 millones de pesos en el valor agregado censal bruto en este año 2017 cifra que corresponde a una variación porcentual anual del 1.7%, la que cifra que corresponde al año 2016 es de 51,406.05 millones de pesos esto representa un avance porcentual de (-)0.6 cifras estimadas del Censo Económico 2014, realizado por el INEGI. Cifra estimada con base a los resultados calculados considerando el PIBE y ITAEE  para proyecta y calcular la variación anual de las cifras publicadas en el Censo Económico 2014 del valor agregado censal bruto, que cuenta con una linea base de 50,239.0 millones de pesos al año 2014. Estas cifras son preliminares. Fuente: BAXICO, INEGI-BIE, INEGI Censo Económico 2014, INEGI SCN','2017-08-11 00:00:00',NULL),(124,'Colocar 1,750 créditos del Fondo Plata Zacatecas con un monto global de 700 millones de pesos.',25,'0','12.70',1,'Se lograron colocar 223 créditos lo que representa una inversión de 85 millones 600 mil pesos. Fuente: registros administrativos del Fondo Plata.','2017-08-04 00:00:00',NULL),(125,'Incrementar el 10% anual el volumen de la producción en la pequeña y mediana minería.',26,'0','0.00',1,'La Planta Beneficiadora \"La Plata\" esta por terminar su etapa de rehabilitación para entrar en operación, con su reactivación serán beneficiados 27 pequeños y medianos mineros','2017-08-04 00:00:00',NULL),(126,'Desarrollar 75 nuevos productos turísticos.',27,'0','14.66',1,'Se crearon y lanzaron 11 productos turísticos:    “Observación Sideral”, en el cual se pone en valor la Zona Arqueológica “La Quemada”; Vinícola Campo Real municipio de Trancoso, Las Entrañas del Teatro Calderón, Paseo en Carreta en Jerez, Romance en San Bernabé, Zacatecas, Me Enamoro en Jerez, Bicitour, Zacatecas, Ruta Vetagrande, Los Sabores de Jerez, Callejoneada Zacatecana y  Biblia de Piedra municipio de Zacatecas. Representa 110% con respecto a los 10 productos establecidos como meta en el primer año. Con respecto a la meta estratégica se tiene un avance de 14.66%.','2017-08-04 00:00:00',NULL),(127,'Incrementar a 3’301,640 la llegada de turistas al centro turístico Zacatecas-Guadalupe.',27,'0','19.10',1,'Se incrementó la llegada de turistas logrando  superar la línea base para el 2016 con 79,572 turistas más, lo que representa un incremento de 14.5% y con respecto a 