,'0','0.00',1,'En esta meta no se ha tenido avance, debido a que estas actividades o acciones, se realizan por medio de proyectos de inversión, lo cual estamos esperando se nos asignen los recursos en ejercicios próximos.','2017-08-04 00:00:00',NULL),(135,'Realizar el inventario o catalogación de los inmuebles públicos y privados en 5 centros históricos y una zona de monumentos.',28,'0','0.00',1,'En esta meta no se ha tenido avance, debido a que estas actividades o acciones, se realizan por medio de proyectos de inversión, lo cual estamos esperando se nos asignen los recursos en ejercicios próximos.','2017-08-04 00:00:00',NULL),(136,'Ampliar y consolidar la atención y cuidado del 100% de las áreas naturales protegidas en el Estado. Asimismo buscar que el total de las áreas naturales protegidas de la entidad cuenten con un programa integral de manejo para su protección y desarrollo.',29,'0','35.00',1,'Se cuenta con diagnósticos ya elaborados de las Zonas Naturales Protegidas y la capacitación correspondiente en la materia para los municipios que conforman estas Áreas. ','2017-08-04 00:00:00',NULL),(137,'Promover a nivel municipal y regional la reglamentación necesaria para proteger a los recursos naturales, en aquellas zonas donde se encuentren actividades mineras e industriales con altos índices de riesgo al medio ambiente.',29,'0','10.00',1,'Hasta la fecha se han atendido a 15 municipios en la conformación y actualización de sus reglamentos y normas en materia de medio ambiente.','2017-08-04 00:00:00',NULL),(138,'Crear el programa de ordenamiento Ecológico el cual dará cobertura al 100% del territorio Estatal.',29,'0','0.00',1,'Se encuentra en etapa de gestión de recursos.','2017-08-04 00:00:00',NULL),(139,'Creación de la Procuraduría Estatal de Protección al Medio Ambiente.',29,'0','100.00',1,'El 31 de diciembre del 2016 se oficializa la creación de la Procuraduría Ambiental.','2017-08-04 00:00:00',NULL),(140,'Construir la Presa de almacenamiento Milpillas y ducto