ogramas federalizados, la SEDESOL es la Dependencia con atribuciones de implementar biodigestores en el tema sanitario. \nA su vez se esta en proceso de buscar el diseño de un programa en la Secretaría para abonar al cambio climático en materia de generación y aprovechamiento de energías renovables.','2017-08-04 00:00:00',NULL),(153,'Realizar  un programa piloto de utilización de energías renovables para el abastecimiento de agua en los municipios.',32,'0','0.00',1,'En el presente ejercicio no se contó con recursos para llevar a cabo este programa, sin embargo, se han evaluado propuestas de captación de agua pluvial, así como procesos de condensación para la generación de agua, por lo que se están presupuestando los proyectos y propuestas para el ejercicio 2018','2017-08-04 00:00:00',NULL),(154,'Dotar de contenedores especiales, para la recolección y separación de residuos a la Zona Metropolitana  y en el 40% de las cabeceras municipales urbanas del Estado.',33,'0','10',1,'Se encuentra en etapa de gestión de recursos, sin embargo se han entregado ya contenedores de separación de basura en la Zona Metropolitana.','2017-08-04 00:00:00',NULL),(155,'Construcción de 3 Plantas de Separación de Basura Regionales.',33,'0','10.00',1,'Actualmente se cuenta con el  proyecto de planta separadora de residuos para la JIORESA.','2017-08-04 00:00:00',NULL),(156,'Construcción de 7 rellenos sanitarios municipales e intermunicipales en la entidad.',33,'0','10',1,'En cumplimiento a esta meta, a la fecha se tienen elaborados 12 proyectos para iniciar con su ejecución.','2017-08-04 00:00:00',NULL),(157,'Fortalecer la Base Regional de Protección Civil.',34,'0','10.00',1,'El proyecto se encuentra en proceso de revisión por parte del FOPREDEN.','2017-08-04 00:00:00',NULL),(158,'Elaboración de los Atlas Estatal de Riesgos Antropogénicos (Químico-Tecnológicos, Sanitario-Ecológicos y Sociorganizativos).',34,'0','10.00',1,'Se dio inicio con estudios y levantamientos cartográficos. ','2017-08-04 00:00:00',NULL),(159,'Diseñar y poner en operación 7 protocolos de actuación de Protección Civil.',34,'0','57.14',1,'\"Se han diseñado cuatro protocolos de actuación 1. Protocolo Temporada Invernal. 2. Protocolo Festival Cultural y Temporada Vacacional de Semana Santa. 3. Incendios Forestales. 4. Lluvias y Sequías.\"','2017-08-04 00:00:00',NULL),(160,'Crear la Secretaría de Desarrollo Urbano, Vivienda y Ordenamiento Territorial.',35,'0','100.00',1,'Se crea la SEDUVOT  encargada de diseñar y ejecutar la política pública en materia de desarrollo urbano, vivienda y ordenamiento territorial, se suprime el Organismo Regularizador de la Tenencia de la Tierra, cuyas funciones pasan a la SEDUVOT.','2017-08-04 00:00:00',NULL),(161,'Actualizar el 100% de los programas de ordenamiento territorial y desarrollo urbano municipales.',35,'0','100.00',1,'Concretamos 38 inscripciones, en todos los Registros Públicos de la Propiedad de 23 nuevos instrumentos de planeación (ocho Programas Regionales de Ordenamiento Territorial, cuatro Programas de Desarrollo Urbano de Centro de Población, cinco Programas Parciales y seis documentos diversos en materia de ordenamiento territorial); teniéndose en proceso de actualización 13 programas de desarrollo urbano; y en elaboración 3 nuevos programas de desarrollo urbano.','2017-08-09 00:00:00',NULL),(162,'Incrementar los espacios públicos en zonas vulnerables.',35,'0','10',1,'Esta en proceso la definición de la propuesta con SEDATU.','2017-08-04 00:00:00',NULL),(163,'Otorgar 15,500 escrituras en el programa de regularización de asentamientos irregulares.',35,'0','31.80',1,'Entregamos 4,929 escrituras de propiedad distribuidas en 9 municipios de la entidad, mediante las que otorgamos certeza jurídica a la ciudadanía mas vulnerable.','2017-08-04 00:00:00',NULL),(164,'Implementar la dotación de 10,000 acciones de vivienda social.',36,'0','20',1,'Se han entregado 2,000 calentadores solares.','2017-08-11 00:00:00',NULL),(165,'Conformar un banco de 100 hectáreas de reservas urbanas para vivienda.',36,'0','0.00',1,'No hay avance por cuestiones presupuestales.','2017-08-11 00:00:00',NULL),(166,'Realizar 752,500 acciones en los programas de mejoramiento de vivienda, autoconstrucción y recamaras adicionales.',36,'0','5',1,'La meta de acuerdo al Oficio No. 324, de fecha 05 de mayo del 2017, se corrigió el número de acciones a 400,000, por lo que al realizarse 37 mil 625 acciones en la materia en el presente ejercicio, se tiene el porcentaje reflejado.Nota: Está en trámite de autorización de modificación de la meta en el Consejo Técnico del COPLADER en la próxima sesión. El avance esta calculado conforme a la nueva meta.','2017-08-11 00:00:00',NULL),(167,'Reestructurar el Sistema de Transporte Urbano.',37,'0','15',1,'Se cuenta con el Plan Integrar de Movilidad Urbana Sustentable de la Zona Metropolitana Zacatecas-Guadalupe (PIMUS) 2016-2040; y 11 reuniones con la compañía Mercedes Benz; la Asociación Nacional de Productores de Autobuses, Camiones y Tracto camiones, A. C.; una empresa de Gas Natural, la Secretaría de Infraestructura y la Subsecretaría del Transporte, con el fin de implementar, dar seguimiento y evaluar un nuevo sistema de transporte, asistiendo a la ciudad de México, al METROBUS, a fin de ver el funcionamiento y organización de este sistema de transporte.','2017-08-04 00:00:00',NULL);
