INSERT INTO `metas_ped_modificaciones` VALUES (1,87,46.6000,46.6000,'Aumentar 3.2% la construcción y rehabilitación de la infraestructra educativa.','Se encuentran 132 obras en proceso de un total de 283.','2017-08-10 09:43:41'),(1,89,52.9600,52.9600,'Aumentar a 58.29 la eficiencia terminal en la educación media superior.','Al realizar una comparación con el ciclo  anterior, vemos un comportamiento de retroceso de este indicador, ya que tuvo en este ciclo un 3.66 % menos, lo cual nos plantea que debemos  redoblar acciones que nos permitan revertir la tendencia negativa de la eficiencia terminal en este nivel, de tal manera que podamos lograr la meta del 58.29 % .','2017-08-10 09:47:26'),(1,85,12.8700,12.8700,'Disminuir el porcentaje de reprobación secundaria por debajo de la media nacional actual','Basándonos en el lugar de posicionamiento a nivel nacional, observamos que nuestro Estado tuvo un retroceso de 8 lugares,  ya que nos ubicábamos  en el lugar  21, y en este ciclo se  ocupa el   29,  lo que demanda  implementar acciones que promuevan una mayor cantidad de  estudiantes que aprueben  las materias comprendidas en los planes de estudio de este nivel educativo.','2017-08-10 09:49:01'),(1,88,14.1100,14.1100,'Disminuir la deserción escolar en la educación media superior al 14.46%','Se observa con satisfacción que se ha rebasado la meta  en un 0.35 %, con ello tenemos que seguir avanzado  para alcanzar mejores resultados.','2017-08-10 09:50:03'),(1,84,6.0100,6.0100,'Disminuir la deserción escolar secundaria al 5.3%','El comportamiento del indicador de deserción en este nivel nos hace concluir que nos estamos alejando de la meta establecida, ya que comparado con el ciclo  anterior que fue de 5.94%, observamos un aumento negativo del 0.07% .','2017-08-10 09:51:12'),(1,86,8.6000,8.6000,'Incrementar el grado promedio de escolaridad a 8.62 en la población escolar en edad de cursar el nivel académico.','Es satisfactorio la tendencia positiva de este indicador, ya estamos a 0.02 décimas para lograr la meta.','2017-08-10 09:52:59'),(1,91,79.0000,79.0000,'Reducir a 10.9 el índice de rezago educativo en el nivel primaria y a 14.8 en secundaria.','Al 31 de diciembre de 2016 el índice de primaria y secundaria es de 13.7 y 18.8 respectivamente. Lo cual representa un avance, ya que en 2010 ','2017-08-10 09:55:20'),(1,83,3.3100,3.3100,'Reducir a menos de 3% la deserción escolar primaria.','El número de niños que abandonan sus estudios en este nivel educativo se ha visto incrementado en relación con los ciclos anteriores, lo que nos esta alejando de la meta establecida. Es importante tomar medidas que reviertan la  tendencia negativa.','2017-08-10 09:56:57'),(1,90,103.4000,103.4000,'Reducir el analfabetismo para alcanzar un índice de 3 puntos.','Al 31 de diciembre de 2016 el índice de analfabetismo es de 2.9.','2017-08-10 09:57:58'),(1,92,38.0000,38.0000,'Concluir la urbanización del Parque de Ciencia y Tecnología de Zacatecas','La urbanización del parque de ciencia  y tecnología, será en tres etapas, de las cuales la primera etapa se encuentra concluida al 100%, para el segundo semestre del año 2017 se realizará la construcción de la primera fase de la segunda etapa de la urbanización que consta de 4.8 hectáreas, para terminar el año con un total de 9.8 hectáreas urbanizadas, además se realizó lo siguiente:\n• Se realizó la construcción y puesta en marcha del pórtico y caseta de entrada a las instalaciones, con una inversión de 1 millón 96 mil 145 pesos.\n• Se construyó la barda perimetral que divide el Paso Inferior Vehicular de la vía férrea que circunda el predio del Parque con las instalaciones de la Unidad Politécnica Interdisciplinaria de Ingenierías de Zacatecas del IPN, con una inversión de 751 mil 51 pesos.\n• Se realizó el equipamiento e imagen urbana del Parque de Ciencia y Tecnología con una inversión 254 mil 494 pesos. Se rehabilitan y remedian de forma sustentable y ecológica más de 2 mil metros cuadrados en el predio de la primera etapa.\n• Se construyó y se puso en marcha el puente de conexión entre la primera y segunda etapa de urbanización con una inversión de 2 millones 257 mil 486 pesos.','2017-08-10 10:06:10'),(1,94,25.0000,25.0000,'Construir y poner en marcha un edificio de Coworking Space destinado al emprendimiento tecnológico.','El edificio Coworking Space, se realizará en cuatro etapas, donde la primera  es la construcción de tres pisos con todos los servicios básicos y se encuentra al 100% terminada, para el segundo semestre del año 2017 se realizará la construcción de la segunda etapa la cual constará de la estructura básica para su instalación. ','2017-08-10 10:07:44'),(1,95,33.0000,33.0000,'Impulsar la creación de al menos 15 Centros públicos y privados de Investigación y Desarrollo Tecnológico en el Parque de Ciencia y Tecnología en Zacatecas.','• Dieron inicio las operaciones del Centro de Investigación en Metalurgia\n• Dieron inicio las operaciones del Centro de Investigación en Matemáticas, A.C. CIMAT\n• El Centro de Investigación y Desarrollo de Soluciones de Tecnología de la Información, Comunicaciones e Ingeniería de Software de la empresa Compulogic S.A. de C.V. se encuentra en proceso de construcción de su edificio con un avance del 50 por ciento\n• Con un avance del 50 por ciento se construye el Centro de Desarrollo Tecnológico y de Innovación en Telecomunicaciones y Tecnología de la Información para la Minería en el estado de Zacatecas de la empresa LASEC, Telecomunicaciones S.A.P.I de C.V.\n• Con una avance del 30 por ciento se construye el Centro de Simulación y Desarrollo de Tecnología en Seguridad Laboral, Minería, por sus siglas CsM-EEK, de la empresa Maya Producciones S.A. de C.V.\n• Con un diez por ciento de avance se construye el Laboratorio de Investigación de Perforación y Sostenimiento de Roca de la empresa Servimolina S. de R. L. \n• Además se asignaron predios al Centro de Investigaciones Biomédicas del Instituto Mexicano del Seguro Social IMSS, por 2 mil 321 metros cuadrados; y al Centro Regional de Desarrollo Espacial en el estado de Zacatecas de la Agencia Espacial Mexicana por un total de 2 mil 461 metros cuadrados.','2017-08-10 10:12:58'),(1,93,26.0000,26.0000,'Otorgar al menos 6,000 becas para la formación de recursos humanos en el ámbito científico, técnico y de innovación.','Para el Consejo Zacatecano de Ciencia, Tecnología e Innovación es de vital importancia contribuir al desarrollo de talento en el sector de la CTI, como una acción que permitirá fortalecer el desempeño académico, posibilitar la eficiencia terminal de las carreras orientadas a los sectores estratégicos de desarrollo y crear mejores condiciones  de bienestar social. En este sentido el COZCyT ha incrementado de manera importante el número de becas y apoyos económicos que otorga a estudiantes e investigadores. Este año que se informa logramos entregar un total de 1 mil 567 becas a 790 mujeres y 777 hombres, por un monto de 7 millones 652 mil pesos.','2017-08-10 10:21:32'),(1,98,20.0000,20.0000,'Alcanzar un crecimiento del 5% acumulado en el número de empresas exportadoras.','Se alcanzó un crecimiento del 100% acumulado según el Padrón de empresas exportadoras del Servicio de Administración Tributaria de la Secretaría de Hacienda y Crédito Público- IMMEX. ','2017-08-10 10:22:53'),(1,99,100.0000,100.0000,'Disminuir el número de días para abrir un negocio, de 26 a 20 días.','Actualmente el número de días para abrir un negocio en Zacatecas es de 15.5 días en promedio, según datos del informe \"Doing Business en México 2016\", realizado por el Banco Mundial.','2017-08-10 10:23:54'),(1,97,25.0000,25.0000,'Lograr un crecimiento en Inversión Extranjera Directa de 6% anual.','Tasa de variación porcentual anual del periodo del primer trimestre de 2016 en comparación al primer trimestre de 2017. Calculo realizado con datos de la Secretaría de Economía Federal.','2017-08-10 10:25:17'),(1,102,35.0000,35.0000,'5,700 alumnos capacitados a través del Instituto de Capacitación para el Trabajo del Estado de Zacatecas.','1,999 alumnos acreditaron satisfactoriamente los cursos contenidos en el catálogo de oferta educativa de la Secretaría de Educación Pública, impartidos por instructores del Instituto de Capacitación para el Trabajo en el Estado de Zacatecas.','2017-08-10 10:26:13'),(1,103,31.9000,31.9000,'Dotar de maquinaria y equipo a 1,000 proyectos de inversión productiva.','Se han apoyado 319 proyectos de inversión de maquinaria y equipo en lo que va de la presente administración, a través del Subprograma Fomento al Autoempleo, en beneficio de 526 personas, con una inversión de 10 millones 248 mil pesos . Fuente: Registros administrativos del Servicio Nacional del Empleo. ','2017-08-10 10:26:58'),(1,101,10.0000,10.0000,'Establecer un Sistema de Planeación, Seguimiento y Evaluación para impulsar la competitividad, la atracción de inversiones y la generación de empleos en el Estado.','Se cuenta con el proyecto y parametros, para la conformación del Sistema, en este sentido se firmó convenio de colaboración con el Instituto de Informática y Estadística del Estado de Jalisco (IIEG), para la transferencia de conocimientos y plataformas de información y con ello establecer el Sistema. Fuente: Secretaría de Economía. ','2017-08-10 10:28:17'),(1,100,15.3000,15.3000,'Generar 40 mil empleos.','6,153 empleos generados observando el periodo de Septiembre de 2016 a Septiembre de 2017, cifras estimadas con base a tendencia del comportamiento del empleo formal y el cruce de proyectos de inversión para el Estado de Zacatecas, si se conserva la tendencia observada, en este sentido para el mes de diciembre de 2017, se tendría una cifra estimada preeliminar de 8,321 plazas creadas. Fuente: IMSS-STyPS, registros administrativos de la SEZAC. ','2017-08-10 10:30:57'),(1,100,15.3000,15.3000,'Generar 40 mil empleos.','6,153 empleos generados observando el periodo de Septiembre de 2016 a Septiembre de 2017, cifras estimadas con base a tendencia del comportamiento del empleo formal y el cruce de proyectos de inversión para el Estado de Zacatecas, si se conserva la tendencia observada, en este sentido para el mes de diciembre de 2017, se tendría una cifra estimada preeliminar de 8,321 plazas creadas. Fuente: IMSS-STyPS, registros administrativos de la SEZAC. ','2017-08-10 10:33:31'),(1,106,5.0000,5.0000,'Ampliar a 4 carriles la carretera Osiris-Cosío','Se solicitó a la SCT la entrega del activo operado por CAPUFE al GODEZAC, para una vez recibida se proceda a la gestión de un modelo de APP para su ampliación a 4 carriles.','2017-08-10 10:34:58'),(1,109,25.0000,25.0000,'Desarrollo de infraestructura de gas natural para dar servicio a Fresnillo.','Se ha realizado la gestión con las empresas desarrolladoras-proveedoras del servicio.','2017-08-10 10:35:25'),(1,110,5.0000,5.0000,'Desarrollo de Infraestructura para realizar despachos de importación y exportación de mercancías en la entidad.','Se ha realizado la pre-evaluación, previa al proceso de habilitación para el  Recinto Fiscalizado Estratégico en el Parque Industrial Aeropuerto.','2017-08-10 10:35:57'),(1,105,15.0000,15.0000,'Gestionar la ampliación de la carretera Jerez-Tlaltenango-Guadalajara.','Se esta realizado la gestión ante la SCT para ampliar el registro que se tiene con la Unidad de Inversiones de la SHCP, con la finalidad de que en cada Ejercicio presupuestal sea asignado recursos.','2017-08-10 10:36:34'),(1,104,45.0000,45.0000,'Gestionar la conclusión de la carretera a 4 carriles Jalpa-Calvillo','Este proyecto se han estado asignando recursos a través del Presupuesto de Egresos de la Federación.','2017-08-10 10:37:07'),(1,104,45.0000,45.0000,'Gestionar la conclusión de la carretera a 4 carriles Jalpa-Calvillo','Este proyecto se han estado asignando recursos a través del Presupuesto de Egresos de la Federación.','2017-08-10 10:37:28'),(1,112,5.0000,5.0000,'Iniciar el Parque Agroindustrial Fresnillo.','La Secretaría de Economía ha realizado el proyecto ejecutivo y de ingenierías, la Secretaría del Campo debe realizar el proyecto de viabilidad económica. Fuente: Dirección de Infraestructura. ','2017-08-10 10:37:53'),(1,108,15.0000,15.0000,'Libramiento ferroviario zona metropolitana.','Se cuentan con estudios de preeinversión y el análisis costo beneficio, que a su vez esta presentado en la unidad de inversiones de la SHCP para su registro.','2017-08-10 10:38:29'),(1,107,35.0000,35.0000,'Modernizar la carretera Fresnillo - Valparaíso','Este proyecto se han estado asignando recursos a través del Presupuesto de Egresos de la Federación.','2017-08-10 10:38:51'),(1,111,0.0000,0.0000,'Urbanizar el Parque Industrial Aeropuerto, segunda etapa.','Se encuentra en desarrollo el proyecto de factibilidad y viabilidad económica. Fuente: Registros administrativos Dirección de Infraestructura SEZAC.','2017-08-10 10:39:19'),(1,120,0.0000,0.0000,'Construcción de 1 Rastro TIF.','Ya se cuenta con oficio de ejecución por parte de la COEPLA para continuar con la firma de convenio con el gobierno federal.','2017-08-10 10:39:46'),(1,121,5.0000,5.0000,'Construcción de 3 Presas El Tilano, Uña de Gato y Canal de Botas Achoquén.','Se encuentra en elaboración el convenio de concertación con la Comisión Nacional del Agua.','2017-08-10 10:40:53'),(1,119,5.0000,5.0000,'Formación de 2 Agroclúster ganaderos.','Se encuentra en trámite la constitución de la figura.','2017-08-10 10:41:10'),(1,113,0.0000,0.0000,'Incrementar en 15% la producción de las y los productores agropecuarios para generar mayor rentabilidad.','','2017-08-10 10:41:51'),(1,117,0.0000,0.0000,'Instalar una sala de subasta ganadera.','Se encuentra en trámite.','2017-08-10 10:42:11'),(1,116,0.0000,0.0000,'Mejoramiento de cobertura vegetal en 500,000 hectáreas.','No se ha iniciado por insuficiencia presupuestal.','2017-08-10 10:42:34'),(1,122,5.0000,5.0000,'Modernizar 600 equipos de bombeo.','A la fecha se lleva un avance de modernización de 30 equipos de bombeo.','2017-08-10 10:42:55'),(1,118,10.0000,10.0000,'Obtener la acreditación zoosanitaria de los municipios de Villa Hidalgo, Villa González, Villa García, Pinos, Noria de Ángeles, Pánfilo Natera.','Se encuentra en etapa de diagnóstico de tuberculosis.','2017-08-10 10:43:36'),(1,115,9.0000,9.0000,'Realizar 12,350 acciones para el mejoramiento génetico de la producción pecuaria','Se continúa con la entrega de sementales a productores pecuarios.','2017-08-10 10:44:10'),(1,114,17.0000,17.0000,'Reconvertir 200 mil hectáreas a sistemas sustentables','A la fecha se lleva un avance de 33,610 hectáreas: 25,000 de cebada, 4,110 de girasol y 4,500 de trigo.','2017-08-10 10:44:49'),(1,124,12.7000,12.7000,'Colocar 1,750 créditos del Fondo Plata Zacatecas con un monto global de 700 millones de pesos.','Se lograron colocar 223 créditos lo que representa una inversión de 85 millones 600 mil pesos. Fuente: registros administrativos del Fondo Plata.','2017-08-10 10:45:31'),(1,123,0.0000,0.0000,'Incrementar el 2.5% anual en el valor agregado en las MIPyMES  (del Censo 2014 al Censo a 2019) a través del encadenamiento.','','2017-08-10 10:46:38'),(1,125,0.0000,0.0000,'Incrementar el 10% anual el volumen de la producción en la pequeña y mediana minería.','La Planta Beneficiadora \"La Plata\" esta por terminar su etapa de rehabilitación para entrar en operación, con su reactivación serán beneficiados 27 pequeños y medianos mineros.','2017-08-10 10:47:15'),(1,126,14.6600,14.6600,'Desarrollar 75 nuevos productos turísticos.','Se crearon y lanzaron 11 productos turísticos:    “Observación Sideral”, en el cual se pone en valor la Zona Arqueológica “La Quemada”; Vinícola Campo Real municipio de Trancoso, Las Entrañas del Teatro Calderón, Paseo en Carreta en Jerez, Romance en San Bernabé, Zacatecas, Me Enamoro en Jerez, Bicitour, Zacatecas, Ruta Vetagrande, Los Sabores de Jerez, Callejoneada Zacatecana y  Biblia de Piedra municipio de Zacatecas. Representa 110% con respecto a los 10 productos establecidos como meta en el primer año. Con respecto a la meta estratégica se tiene un avance de 14.66%.','2017-08-10 10:48:44'),(1,127,19.1000,19.1000,'Incrementar a 3’301,640 la llegada de turistas al centro turístico Zacatecas-Guadalupe.','Se incrementó la llegada de turistas logrando  superar la línea base para el 2016 con 79,572 turistas más, lo que representa un incremento de 14.5% y con respecto a la meta estratégica del quinquenio llevamos un 19.1% de avance.','2017-08-10 10:49:25'),(1,128,11.5100,11.5100,'Realizar 165 Congresos Magnos.','Se realizaron 19 Congresos magnos representando  un avance del 76% con respecto a la meta establecida para el primer año del quinquenio de 25 Congresos. En lo que respecta al avance de la meta estratégica quinquenal el avance es de 11.51%.','2017-08-10 10:50:01'),(1,134,0.0000,0.0000,'Elaborar los planes parciales de 3 zonas típicas y una zona de monumentos.','En esta meta no se ha tenido avance, debido a que estas actividades o acciones, se realizan por medio de proyectos de inversión, lo cual estamos esperando se nos asignen los recursos en ejercicios próximos.','2017-08-10 10:50:44'),(1,133,30.0000,30.0000,'Impulsar la declaratoria de 7 monumentos y 3 de inmuebles como monumentos.','A la fecha del presente informe se han realizado 2 proyectos de iniciativa de decreto para la declaratoria de Zona de Monumentos (Villa González Ortega y Fresnillo) y un proyecto de iniciativa de decreto para la declaratoria de Monumento (El inmueble conocido como \"La Tronera\").','2017-08-10 10:51:22'),(1,132,8.8000,8.8000,'Incrementar 28% los talleres de formación e iniciación artística, capacitación y profesionalización para llegar al 2021 a 1,000 talleres.','En este período contribuimos a la formación cultural realizando 88 talleres de iniciación, capacitación y profesionalización  artística.','2017-08-10 10:51:54'),(1,129,21.2500,21.2500,'Incrementar el 30% en asistencia a museos y espacios culturales para llegar al 2021 un millón de visitantes.','Durante este período registramos 212 mil 570 asistentes a museos y espacios culturales.','2017-08-10 10:52:55'),(1,131,9.1300,9.1300,'Incrementar un 25% los estímulos a creadores  zacatecanos para llegar al 2021 a 900 estímulos entregados.','En este período hemos otorgado 104 estímulos económicos y reconocimiento a la trayectoria de creadores y creadoras zacatecanos.','2017-08-10 10:53:26'),(1,130,11.5500,11.5500,'Incrementar un 30% los eventos artístico culturales para llegar al 2021 a 6 mil quinientos eventos.','En este año realizamos un total de 594 eventos artístico culturales.','2017-08-10 10:53:52'),(1,135,0.0000,0.0000,'Realizar el inventario o catalogación de los inmuebles públicos y privados en 5 centros históricos y una zona de monumentos.','En esta meta no se ha tenido avance, debido a que estas actividades o acciones, se realizan por medio de proyectos de inversión, lo cual estamos esperando se nos asignen los recursos en ejercicios próximos.','2017-08-10 10:54:31'),(1,136,35.0000,35.0000,'Ampliar y consolidar la atención y cuidado del 100% de las áreas naturales protegidas en el Estado. Asimismo buscar que el total de las áreas naturales protegidas de la entidad cuenten con un programa integral de manejo para su protección y desarrollo.','Se cuenta con diagnósticos ya elaborados de las Zonas Naturales Protegidas y la capacitación correspondiente en la materia para los municipios que conforman estas Áreas. ','2017-08-10 10:55:33'),(1,139,100.0000,100.0000,'Creación de la Procuraduría Estatal de Protección al Medio Ambiente.','El 31 de diciembre del 2016 se oficializa la creación de la Procuraduría Ambiental.','2017-08-10 10:55:57'),(1,138,0.0000,0.0000,'Crear el programa de ordenamiento Ecológico el cual dará cobertura al 100% del territorio Estatal.','Se encuentra en etapa de gestión de recursos.','2017-08-10 10:56:15'),(1,137,10.0000,10.0000,'Promover a nivel municipal y regional la reglamentación necesaria para proteger a los recursos naturales, en 