iento de esta meta a final del quinquenio.','2017-08-10 11:02:32'),(1,145,5.6000,5.6000,'Instalación de 75,000 micromedidores.','Para el ejercicio fiscal 2017 el organismo ha dejado de percibir por incentivos federales alrededor de 16 millones de pesos por causas ajenas al mismo, por lo que no se ha tenido la posibilidad de un mayor avance en esta meta.','2017-08-10 11:03:32'),(1,148,72.0000,72.0000,'Reactivar al 100% de las plantas tratadoras de agua existentes.','Actualmente se tiene un 72% de la plantas tratadoras en operación, llevando a cabo acciones para que a finales del 2017 se tenga una operación del 80% del total de la plantas disponibles en el estado.','2017-08-10 11:05:14'),(1,141,2.3100,2.3100,'Rehabilitación  integral de infraestructura hidráulica, en zonas de la jurisdicción en las cuales las redes se encuentran obsoletas.','En el ejercicio fiscal 2017 hubo un recorte presupuestal por CONAGUA de alrededor del 70% para apoyo a programas federales, derivando en afectación al cumplimiento de esta meta.','2017-08-10 11:05:57'),(1,142,130.0000,130.0000,'Rehabilitación y equipamiento de fuentes de abastecimiento de la JIAPAZ.','Se instalaron 13 nuevos equipos electromecánicos en fuentes de abastecimiento en mayor cantidad a la meta establecida que era 10 equipos.','2017-08-10 11:06:49'),(1,144,67.0700,67.0700,'Reutilizar el 100% del agua tratada de las plantas operadas por JIAPAZ.','Nos encontramos en negociaciones de intercambio y/o venta de agua residual tratada, como en la gestión de recursos para llevar a cabo la totalidad de los proyectos. ','2017-08-10 11:07:57'),(1,151,20.0000,20.0000,'Creación del sistema para la generación de inventarios y monitoreo de residuos y elementos contaminantes existentes en el Estado.','Se inicio con el sistema para el registro de los residuos y elementos contaminantes como primera etapa.','2017-08-10 11:08:45'),(1,150,20.0000,20.0000,'Elaborar el Programa Estatal de Cambio Climático.','Se conformó la Comisión Intersecretarial de Cambio Climático y el Observatorio Ciudadano, dando inicio a los trabajos para sentar las bases de dicho programa.','2017-08-10 11:09:20'),(1,152,0.0000,0.0000,'Implementación y/o consolidación  de Proyectos de Biodigestores en el Estado.','Solicitaran mediante oficio que se pase la meta a SECAMPO.','2017-08-10 11:10:48'),(1,153,0.0000,0.0000,'Realizar  un programa piloto de utilización de energías renovables para el abastecimiento de agua en los municipios.','En el presente ejercicio no se contó con recursos para llevar a cabo este programa.','2017-08-10 11:11:18'),(1,155,11.0000,11.0000,'Construcción de 3 Plantas de Separación de Basura Regionales.','Actualmente se cuenta con el  proyecto de planta separadora de residuos para la JIORESA.','2017-08-10 11:11:49'),(1,156,2.0000,2.0000,'Construcción de 7 rellenos sanitarios municipales e intermunicipales en la entidad.','En cumplimiento a esta meta, a la fecha se tienen elaborados 12 proyectos para iniciar con su ejecución.','2017-08-10 11:12:10'),(1,154,1.0000,1.0000,'Dotar de contenedores especiales, para la recolección y separación de residuos a la Zona Metropolitana  y en el 40% de las cabeceras municipales urbanas del Estado.','Se encuentra en etapa de gestión de recursos, sin embargo se han entregado ya contenedores de separación de basura en la Zona Metropolitana.','2017-08-10 11:12:45'),(1,159,57.1400,57.1400,'Diseñar y poner en operación 7 protocolos de actuación de Protección Civil.','Se han diseñado cuatro protocolos de actuación\n1. Protocolo Temporada Invernal.\n2. Protocolo Festival Cultural y Temporada Vacacional de Semana Santa.\n3. Incendios Forestales.\n4. Lluvias y Sequías.','2017-08-10 11:13:21'),(1,158,10.0000,10.0000,'Elaboración de los Atlas Estatal de Riesgos Antropogénicos (Químico-Tecnológicos, Sanitario-Ecológicos y Sociorganizativos).','Se dio inicio con estudios y levantamientos cartográficos. ','2017-08-10 11:15:04'),(1,157,10.0000,10.0000,'Fortalecer la Base Regional de Protección Civil.','El proyecto se encuentra en proceso de revisión por parte del FOPREDEN.','2017-08-10 11:15:21'),(1,161,100.0000,100.0000,'Actualizar el 100% de los programas de ordenamiento territorial y desarrollo urbano municipales.','Concretamos 38 inscripciones, en todos los Registros Públicos de la Propiedad de 23 nuevos instrumentos de planeación (ocho Programas Regionales de Ordenamiento Territorial, cuatro Programas de Desarrollo Urbano de Centro de Población, cinco Programas Parciales y seis documentos diversos en materia de ordenamiento territorial); teniéndose en proceso de actualización 13 programas de desarrollo urbano; y en elaboración 3 nuevos programas de desarrollo urbano.','2017-08-10 11:16:38'),(1,160,100.0000,100.0000,'Crear la Secretaría de Desarrollo Urbano, Vivienda y Ordenamiento Territorial.','Se crea la SEDUVOT  encargada de diseñar y ejecutar la política pública en materia de desarrollo urbano, vivienda y ordenamiento territorial, se suprime el Organismo Regularizador de la Tenencia de la Tierra, cuyas funciones pasan a la SEDUVOT.','2017-08-10 11:17:03'),(1,162,5.0000,5.0000,'Incrementar los espacios públicos en zonas vulnerables.','Esta en proceso la definición de la propuesta con SEDATU.','2017-08-10 11:17:38'),(1,163,23.5400,23.5400,'Otorgar 15,500 escrituras en el programa de regularización de asentamientos irregulares.','Entregamos en este periodo 3 mil 649 escrituras de propiedad, distribuidas en 38 municipios de la entidad, mediante las que otorgamos certeza jurídica a la ciudadanía más vulnerable, destacando la zona metropolitana de Zacatecas-Guadalupe.','2017-08-10 11:18:13'),(1,165,0.0000,0.0000,'Conformar un banco de 100 hectáreas de reservas urbanas para vivienda.','No hay avance por cuestiones presupuestales.','2017-08-10 11:18:41'),(1,164,4.5000,4.5000,'Implementar la dotación de 10,000 acciones de vivienda social.','Se han entregado 750 calentadores solares.','2017-08-10 11:18:57'),(1,166,5.3900,5.3900,'Realizar 400,000 acciones en los programas de mejoramiento de vivienda, autoconstrucción y recamaras adicionales.','La meta de acuerdo al Oficio No. 324, de fecha 05 de mayo del 2017, se corrigió el número de acciones a 400,000, por lo que al realizarse 21 mil 574 acciones en la materia en el presente ejercicio, se tiene el porcentaje reflejado.','2017-08-10 11:20:16'),(1,167,10.0000,10.0000,'Reestructurar el Sistema de Transporte Urbano.','Se cuenta con el Plan Integrar de Movilidad Urbana Sustentable de la Zona Metropolitana Zacatecas-Guadalupe (PIMUS) 2016-2040; y 11 reuniones con la compañía Mercedes Benz; la Asociación Nacional de Productores de Autobuses, Camiones y Tracto camiones, A. C.; una empresa de Gas Natural, la Secretaría de Infraestructura y la Subsecretaría del Transporte, con el fin de implementar, dar seguimiento y evaluar un nuevo sistema de transporte, asistiendo a la ciudad de México, al METROBUS, a fin de ver el funcionamiento y organización de este sistema de transporte.','2017-08-10 11:22:10'),(14,95,33.0000,33.0000,'Impulsar la creación de al menos 15 Centros públicos y privados de Investigación y Desarrollo Tecnológico en el Parque de Ciencia y Tecnología en Zacatecas.','• Dieron inicio las operaciones del Centro de Investigación en Metalurgia\n• Dieron inicio las operaciones del Centro de Investigación en Matemáticas, A.C. CIMAT\n• El Centro de Investigación y Desarrollo de Soluciones de Tecnología de la Información, Comunicaciones e Ingeniería de Software de la empresa Compulogic S.A. de C.V. se encuentra en proceso de construcción de su edificio con un avance del 50 por ciento\n• Con un avance del 50 por ciento se construye el Centro de Desarrollo Tecnológico y de Innovación en Telecomunicaciones y Tecnología de la Información para la Minería en el estado de Zacatecas de la empresa LASEC, Telecomunicaciones S.A.P.I de C.V.\n• Con una avance del 30 por ciento se construye el Centro de Simulación y Desarrollo de Tecnología en Seguridad Laboral, Minería, por sus 