ma de transporte, asistiendo a la ciudad de México, al METROBUS, a fin de ver el funcionamiento y organización de este sistema de transporte.','2017-08-11 13:38:56'),(15,136,35.0000,20.0000,'Ampliar y consolidar la atención y cuidado del 100% de las áreas naturales protegidas en el Estado. Asimismo buscar que el total de las áreas naturales protegidas de la entidad cuenten con un programa integral de manejo para su protección y desarrollo.','Se mantiene una constante gestión con autoridades Federales y Municipales, así como con la Cámara de Diputados para la realización  de los 3 planes de manejo de las Áreas Naturales Protegidas de Carácter Federal.\nSe cuenta al momento con 2 planes de manejo correspondientes al mismo numero de Areas Naturales de las 10 con las que cuenta la Entidad.','2017-08-11 14:12:04'),(15,138,0.0000,0.0000,'Crear el programa de ordenamiento Ecológico el cual dará cobertura al 100% del territorio Estatal.','Para el ejercicio 2016-2017 no se corto con presupuesto asignado para llevar a cabo las acciones correspondientes de esta meta, por lo que se tiene presupuestado para el ejercicio 2018 los recursos necesarios para iniciar y poner en marcha las acciones que darán cumplimiento a esta meta.','2017-08-11 14:14:54'),(15,140,20.0000,20.0000,'Construir la Presa de almacenamiento Milpillas y ducto de distribución de agua para el corredor Fresnillo-Zacatecas-Guadalupe.','Están en Proceso todos los Estudios Necesarios Previos a la construcción.\nA la techa ya se encuentran en proceso de licitación y con recurso aprobado los estudios correspondientes de ingeniería básica del acueducto, geológicos , geotécnicos, entre otros. ','2017-08-11 14:45:04'),(15,152,0.0000,0.0000,'Implementación y/o consolidación  de Proyectos de Biodigestores en el Estado.','En apego a las reglas de operación de los programas federalizados, la SEDESOL es la Dependencia con atribuciones de implementar biodigestores en el tema sanitario. \nA su vez se esta en proceso de buscar el diseño de un programa en la Secretaría para abonar al cambio climático en materia de generación y aprovechamiento de energías renovables.','2017-08-11 15:10:38'),(15,153,0.0000,0.0000,'Realizar  un programa piloto de utilización de energías renovables para el abastecimiento de agua en los municipios.','En el presente ejercicio no se contó con recursos para llevar a cabo este programa, sin embargo, se han evaluado propuestas de captación de agua pluvial, así como procesos de condensación para la generación de agua, por lo que se están presupuestando los proyectos y propuestas para el ejercicio 2018','2017-08-11 15:11:51'),(15,155,11.0000,10.0000,'Construcción de 3 Plantas de Separación de Basura Regionales.','Actualmente se cuenta con el  proyecto de planta separadora de residuos para la JIORESA.','2017-08-11 15:12:21'),(15,156,2.0000,10.0000,'Construcción de 7 rellenos sanitarios municipales e intermunicipales en la entidad.','En cumplimiento a esta meta, a la fecha se tienen elaborados 12 proyectos para iniciar con su ejecución.','2017-08-11 15:12:40'),(15,154,1.0000,10.0000,'Dotar de contenedores especiales, para la recolección y separación de residuos a la Zona Metropolitana  y en el 40% de las cabeceras municipales urbanas del Estado.','Se encuentra en etapa de gestión de recursos, sin embargo se han entregado ya contenedores de separación de basura en la Zona Metropolitana.','2017-08-11 15:12:53'),(8,123,68.0000,68.0000,'Incrementar el 2.5% anual en el valor agregado en las MIPyMES  (del Censo 2014 al Censo a 2019) a través del encadenamiento.',' ','2017-08-11 15:39:12'),(8,123,68.0000,68.0000,'Incrementar el 2.5% anual en el valor agregado en las MIPyMES  (del Censo 2014 al Censo a 2019) a través del encadenamiento.','En términos absolutos tenemos un avance anual proyectado de 52,296 millones de pesos en el valor agregado censal bruto en este año 2017 cifra que corresponde a una variación porcentual anual del 1.7%, la que cifra que corresponde al año 2016 es de 51,406.05 millones de pesos esto representa un avance porcentual de (-)0.6 cifras estimadas del Censo Económico 2014, realizado por el INEGI. Cifra estimada con base a los resultados calculados considerando el PIBE y ITAEE  para proyecta y calcular la variación anual de las cifras publicadas en el Censo Económico 2014 del valor agregado censal bruto, que cuenta con una linea base de 50,239.0 millones de pesos al año 2014. Estas cifras son preliminares. Fuente: BAXICO, INEGI-BIE, INEGI Censo Económico 2014, INEGI SCN','2017-08-11 16:04:17'),(13,163,23.5400,9.5900,'Otorgar 15,500 escrituras en el programa de regularización de asentamientos irregulares.','Entregamos 1485 escrituras de propiedad distribuidas en 9 municipios de la entidad, mediante las que otorgamos certeza jurídica a la ciudadanía mas vulnerable.','2017-08-14 11:56:58'),(26,8,50.0000,50.0000,'Crear el Sistema Estatal de Evaluación.','Se tiene el diseño normativo terminado (lineamientos), se publicará en en el marco de la Nueva Ley de Planeación aprobada por la Legislatura del Estado. Sin embargo, la comisión interinstitucional que formará el Consejo de Evaluación esta en funcionamiento, misma que publicó el Programa Anual de Evaluación y esta coordinando las evaluación definidas en el programa, como aquellas adicionales que con el ámbito de la competencia pudieran realizarse de conformidad a las evaluaciones a políticas publicas, programas y acciones Federales, adicionales a las establecidas en el PAE 2017, las cuales tendrán el mismo tratamiento que las actuales. Así mismo, se ha culminado el Diplomado en Evaluación de Política Pública, con una alianza de maestros investigadores de la UAZ y servidores públicos, lo que se sienta parte de las bases para el órgano evaluador.','2017-08-14 16:01:57'),(5,82,-9.9700,-9.9700,'Incrementar en un 46% la cantidad de personas que utilizan las instalaciones deportivas estatales para fines de activación física regular y práctica deportiva sistemática.','Debido a