12  sementales bovinos, ovinos y caprinos mejorados genéticamente, lo que significa un avance del 11% con respecto a la meta quinquenal de 12,350.','2017-08-16 10:51:07'),(6,114,17.0000,17.0000,'Reconvertir 200 mil hectáreas a sistemas sustentables','A la fecha se lleva un avance de 33,671 hectáreas: 25,134 de cebada, 4,003 de girasol y 4,534 de trigo.','2017-08-16 10:51:37'),(6,91,79.0000,79.1000,'Reducir a 10.9 el índice de rezago educativo en el nivel primaria y a 14.8 en secundaria.','Al 31 de diciembre de 2016 el índice de primaria y secundaria es de 13.7 y 18.8 respectivamente, sin embargo, la población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como personas que cumplen 15 años y que no tienen educación primaria o secundaria, jóvenes que desertan del sistema escolarizado, y factores a favor como es, personas en rezago educativo que fallecen, adultos que concluyen nivel en el IZEA, entre otros.','2017-08-16 12:05:27'),(6,90,103.4000,103.4000,'Reducir el analfabetismo para alcanzar un índice de 3 puntos.','Al 31 de diciembre de 2016 el índice de analfabetismo es de 2.9, cerca del 40% de la población analfabeta son adultos mayores y aunque es difícil atenderlos por diversas situaciones como enfermedades, problemas con la vista, renuencia, etc., se tiene el compromiso de atender a todos, incentivando su esfuerzo ya que mediante la Campaña de Alfabetización se les otorga un apoyo de $500 pesos., la población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como personas que cumplen 15 años y que son analfabetas; Factores a favor como es personas analfabetas que fallecen, adultos que se alfabetizan en el IZEA, entre otros.','2017-08-16 12:06:35'),(6,90,103.4000,103.4000,'Reducir el analfabetismo para alcanzar un índice de 3 puntos.','Al 31 de diciembre de 2016 el índice de analfabetismo es de 2.9, cerca del 40% de la población analfabeta son adu