 otorgado 104 estímulos económicos y reconocimiento a la trayectoria de creadores y creadoras zacatecanos.','2017-09-21 10:28:49'),(43,102,35.0000,35.0000,'5,700 alumnos capacitados a través del Instituto de Capacitación para el Trabajo del Estado de Zacatecas.','1,999 alumnos acreditaron satisfactoriamente los cursos contenidos en el catálogo de oferta educativa de la Secretaría de Educación Pública, impartidos por instructores del Instituto de Capacitación para el Trabajo en el Estado de Zacatecas.','2017-09-21 13:41:20'),(43,102,35.0000,35.0000,'5,700 alumnos capacitados a través del Instituto de Capacitación para el Trabajo del Estado de Zacatecas.','1,999 alumnos acreditaron satisfactoriamente los cursos contenidos en el catálogo de oferta educativa de la Secretaría de Educación Pública, impartidos por instructores del Instituto de Capacitación para el Trabajo en el Estado de Zacatecas.','2017-09-21 13:41:28'),(41,76,16.6600,-33.3300,'Mejorar en 6 posiciones en el medallero general de la Olimpiada Nacional.','Con la reducción de categorías en la Olimpiada Nacional cambia obligadamente la linea base del indicador hasta 2016. Al ubicarse el estado en el lugar 31 de la tabla general de medallas, un descenso en dos posiciones significó un avance negativo respecto a la meta quinquenal.','2017-09-22 13:44:20'),(12,114,17.0000,33.0000,'Reconvertir 200 mil hectáreas a sistemas sustentables','A la fecha se lleva un avance de 64,494 hectáreas: 49,359 de cebada, 8,006 de girasol y 9,129 de trigo.','2017-09-26 14:34:16'),(12,115,11.0000,20.0000,'Realizar 12,350 acciones para el mejoramiento génetico de la producción pecuaria','Del periodo septiembre 2016 a septiembre 2017, se ha realizado la entrega en eventos ganaderos un total de 1,468  sementales bovinos, ovinos y caprinos mejorados genéticamente, así como 16 capacitaciones de buenas prácticas refrerentes a inseminación de ovino caprino, lo  que significa un avance del 20% con respecto a la meta quinquenal de 12,350.','2017-09-26 14:36:01'),(12,116,3.0000,24.0000,'Mejoramiento de cobertura vegetal en 500,000 hectáreas.','Se lleva un avance a la fecha de 11,918 hectáreas con diversas obras de conservación de suelo y agua que con respecto a la meta quinquenal representa un avance del 24%.','2017-09-26 14:36:37'),(12,117,5.0000,5.0000,'Instalar una sala de subasta ganadera.','En este indicador se debe considerar que se trata de una segunda etapa para la conclusión del proyecto en el que ya con anterioridad existe infraestructura física que es el soporte para la consolidación del mismo;  en el compromiso que corresponde a la actual administración, se tiene ya elaborado el proyecto ejecutivo de la etapa correspondiente, el cual se encuentra en trámite en FIRCO, por lo que se estima un avance del 5% con respecto a la meta quinquenal.','2017-09-26 14:37:48'),(12,118,10.0000,10.0000,'Obtener la acreditación zoosanitaria de los municipios de Villa Hidalgo, Villa González, Villa García, Pinos, Noria de Ángeles, Pánfilo Natera.','En coordinación con las instancias sanitarias en materia pecuaria, se iniciaron los trabajos correspondientes al diagnóstico de prevalencia de  tuberculosis en el ganado con un avance del 10% en el muestreo preliminar que es determinante para definir el universo del muestreo de ganado para continuar con las etapas subsecuentes exigidas para el establecimiento del estatus sanitario; estimándose a la fecha un avance en el cumplimiento de este indicador del 10%.','2017-09-26 14:38:45'),(12,119,5.0000,12.0000,'Formación de 2 Agroclúster ganaderos.','Se encuentra en trámite la constitución legal de los beneficiarios del proyecto en la figura jurídica que favorezca el cumplimiento de objetivos del proyecto; otorgandole un valor estimado del 12% a esta acción con respecto de la meta quinquenal.','2017-09-26 14:39:23'),(12,120,10.0000,10.0000,'Construcción de 1 Rastro TIF.','En este indicador ya se cuenta con anteproyecto de ejecución, el terreno en comodato para la construcción de la obra y el oficio de ejecución por parte de la COEPLA para dar inicio a la firma de convenio con el gobierno federal; es importante señalar que es un proyecto tripartita y que depende de las aportaciones que cada una de las partes realice en su oportunidad, para este caso la aportación correspondiente al municipio presenta restricción presupuestal lo que esta retrasando su ejecución por lo que se estima un avance importante en el rubro de gestión del financiamiento y sin avance en es aspecto físico.','2017-09-26 14:40:34'),(12,121,5.0000,15.0000,'Construcción de 3 Presas El Tilano, Uña de Gato y Canal de Botas Achoquén.','Para el caso de la obra de la presa El Tilano, se ha determinado realizar una relocalización debido a que el terreno propuesto resultó con fallas geológicas que imposibilitan su construcción en el sitio propuesto; para la presa Uña de Gato, se encuentra en proceso de actualización  el proyecto ejecutivo con posible ejecución de la obra en el ejercicio 2018; respecto al proyecto canal de Botas-Achoquén, la obra se encuentra en proceso de licitación. Es importante tener presente, que este indicador también corresponde a una meta quinquenal.','2017-09-26 14:41:51'),(12,122,73.0000,78.0000,'Modernizar 600 equipos de bombeo.','De septiembre 2016 a la fecha se han modernizado 465 equipos de bombeo agrícola,  lo que representa un avance del 78%  con respecto a la meta quinquena, es importante señalar que el financiamiento para este programa se derivó de un compromiso presidencial de campaña, mismo que concluye el próximo año. Y que por tanto es posible que se disminuya el ritmo de equipamientos.','2017-09-26 14:42:32'),(47,65,18.3000,18.3000,'Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.','\"Con las convocatorias presentes y las ya lanzadas hasta el mes de septiembre de  2017, la atención a jóvenes  es de 33,909 jóvenes a través de los distintos programas y acciones del INJUVENTUD. \n\nEl Plan Estatal de Desarrollo 2017-2021 mandata la atención al 20% de la población para todo el quinquenio, lo cual es equivalente a 98,682 jóvenes tomando como base a las 493,409 personas entre 12 y 29 años de edad que habitan el estado, según la Encuesta Intercensal de 2015 realizada por el INEGI. \n\nAsí, la meta anual de atención es de 19,736 personas y la meta quinquenal es de 98,682 jóvenes. Los 33,909 jóvenes atendidos hasta ahora son equivalentes al 34.36% de la meta quinquenal y una superación de la meta anual (19,736) en 71.8 puntos porcentuales, es decir, el INJUVENTUD ha atendido al 171.8% de la meta anual. \n\n (NOTA METODOLOGÍA O METADATO: 493,409 jóvenes son el 100% de la población joven. El 20% que mandata el PED es equivalente a 98,681 jóvenes. Al dividir tal número entre los 5 años de la administración estatal se obtiene la meta anual, que es igual a 19,736 jóvenes. Así, 34.36%). ','2017-09-27 17:35:25'),(47,65,18.3000,18.3000,'Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.','\"Con las convocatorias presentes y las inmediatas a lanzarse, al finalizar el mes de agosto e inicio el mes de septiembre de  2017 la atención a jóvenes   será de 18,076 jóvenes a través de los distintos programas y acciones del INJUVENTUD. Al 15 de mayo, el corte de atención a la población juvenil era de 14,936 jóvenes.  Es decir, el Plan Estatal de Desarrollo 2017-2021 mandata la atención al 20% de la población para todo el quinquenio, lo cual es equivalente a 98,682 jóvenes de los 493,409 que habitan el estado, según la Encuesta Intercensal de 2015 realizada por el INEGI. Así, la meta anual de intención es de 19,736 jóvenes. El 18.3% atendido al primero de septiembre es equivalente al 91.6% de esos 19,736 jóvenes que nos mandata el PED 2017-2021 atender. (NOTA METODOLOGÍA O METADATO: 493,409 jóvenes son el 100% de la población joven. El 20% que mandata el PED es equivalente a 98,681 jóvenes. Al dividir tal número entre los 5 años de la administración estatal se obtiene la meta anual, que es igual a 19,736 jóvenes. Así, 18.3% equivale a la proyección de jóvenes a atender (18,076) de esos 98,681 e igualmente, esa cantidad (18,076) equivale al 91.6% de la meta anual de atención.)\"','2017-09-27 17:37:48'),(47,65,18.3000,18.3000,'Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.','\"Con las convocatorias presentes y las inmediatas a lanzarse, al finalizar el mes de agosto e inicio el mes de septiembre de  2017 la atención a jóvenes   será de 18,076 jóvenes a través de los distintos programas y acciones del INJUVENTUD. Al 15 de mayo, el corte de atención a la población juvenil era de 14,936 jóvenes.  Es decir, el Plan Estatal de Desarrollo 2017-2021 mandata la atención al 20% de la población para todo el quinquenio, lo cual es equivalente a 98,682 jóvenes de los 493,409 que habitan el estado, según la Encuesta Intercensal de 2015 realizada por el INEGI. Así, la meta anual de intención es de 19,736 jóvenes. El 18.3% atendido al primero de septiembre es equivalente al 91.6% de esos 19,736 jóvenes que nos mandata el PED 2017-2021 atender. (NOTA METODOLOGÍA O METADATO: 493,409 jóvenes son el 100% de la población joven. El 20% que mandata el PED es equivalente a 98,681 jóvenes. Al dividir tal número entre los 5 años de la administración estatal se obtiene la meta anual, que es igual a 19,736 jóvenes. Así, 18.3% equivale a la proyección de jóvenes a atender (18,076) de esos 98,681 e igualmente, esa cantidad (18,076) equivale al 91.6% de la meta anual de atención.)\"','2017-09-27 17:38:22'),(47,65,18.3000,34.3000,'Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.','\"Con las convocatorias presentes y las inmediatas a lanzarse, al finalizar el mes de agosto e inicio el mes de septiembre de  2017