Atender de manera integral al 20% de la población de jóvenes de 12 a 29 años de edad con diferentes programas institucionales.','Con las convocatorias presentes y las inmediatas a lanzarse, al finalizar el mes de septiembre de 2017 la atención a jóvenes  es de 33,909 jóvenes a través de los distintos programas y acciones del INJUVENTUD. El Plan Estatal de Desarrollo 2017-2021 mandata la atención al 20% de la población para todo el quinquenio, lo cual es equivalente a 98,682 jóvenes de los 493,409 que habitan el estado, según la Encuesta Intercensal de 2015 realizada por el INEGI. Así, la meta anual de intención es de 19,736 jóvenes. Los 33,909 jóvenes representan el 171.81% de la meta anual [(33,909/19,736)*100] de la meta anual que nos mandata el PED 2017-2021. ','2017-09-29 17:25:26'),(2,90,103.4000,103.4000,'Reducir el analfabetismo para alcanzar un índice de 3 puntos.','En el año 2016, el Estado tenía un índice de analfabetismo de 3.6 de acuerdo a la Estimación oficial al 31 de diciembre de 2015. \nAl 31 de diciembre de 2016 (según la última estimación), el índice de analfabetismo es de 2.9, lo que significa que para el año 2017 se ha reducido 0.7 puntos y se está cumpliendo por el momento la meta planteada. \nCerca del 40% de la población analfabeta son adultos mayores y aunque es difícil atenderlos por diversas situaciones como enfermedades, problemas con la vista, renuencia, etc., se tiene el compromiso de atender a todos, incentivando su esfuerzo, ya que mediante la Campaña de Alfabetización se les otorga un apoyo de $500 pesos. La población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como: personas que cumplen 15 años y que son analfabetas; Factores a favor como:  personas analfabetas que fallecen, adultos que se alfabetizan en el IZEA, entre otros.','2017-10-11 15:15:34'),(2,91,79.1000,79.1000,'Reducir a 10.9 el índice de rezago educativo en el nivel primaria y a 14.8 en secundaria.','En el año 2016, el Estado tenía un índice del 14.9 en primaria y 18.8 en el nivel secundaria, lo anterior, de acuerdo a la Estimación oficial al 31 de diciembre de 2015.\nAl 31 de diciembre de 2016 el índice de primaria y secundaria es de 13.7 (se redujo 1.2 puntos) y 18.8 respectivamente, esta información es la vigente para el año 2017. Es necesario informar que la población es tan dinámica que puede variar el índice hacia arriba o hacia abajo, debido a varios factores  en contra como personas que cumplen 15 años y que no tienen educación primaria o secundaria, jóvenes que desertan del sistema escolarizado, y factores a favor como es, personas en rezago educativo que fallecen, adultos que concluyen nivel en el IZEA.','2017-10-11 15:17:42'),(11,37,3.5000,129.0000,'Disminuir a 4% el porcentaje de pobreza extrema en el Estado.','El dato corresponde a 2016, y podrá modificarse hasta el momento en que CONEVAL emita el siguiente informe.','2017-11-06 18:24:14'),(11,38,0.0000,17.1400,'Entregar 1,400,000 apoyos escolares.','Se tienen programadas las primeras entregas conforme al inicio del ciclo escolar 2017 - 2018. ','2017-11-06 18:55:06');
